(10, '5 Tips KPR di Makassar', '&lt;p&gt;Banyak\nyang keliru soal KPR selama ini. Anggapan salah tentang alur bisnis properti\nsering terjadi di sekitar kita. Nah, berikut beberapa tips dalam ber-KPR.&lt;/p&gt;\n\n1. sebagian orang\n     takut berhutnag. Ketika ia berhutang tentu akan mengambil kredit dengan\n     nilai yang paling kecil &amp;amp; waktu yang paling pendek. Padahal resiko\n     kredit pendek itu besar. Jadi, ambillah kredit dengan jangka waktu paling\n     lama. Agar &lt;em&gt;&lt;span&gt;cash flow &lt;/span&gt;&lt;/em&gt;keuangan\n     pribadi juga aman.&lt;br&gt;&lt;br&gt;2. Orang\n     menganngap bahwa saat usaha menurun, baru mulai meminjam uang. Sehingga\n     bank kadang menolak memberikan pinjaman pada kondisi ini.&lt;br&gt;&lt;br&gt;3. Ubahlah pola\n     pengelolaan keuangan dari &lt;strong&gt;&lt;span&gt;Penghasilan-Pengeluaran\n     = TABUNGAN&lt;/span&gt;&lt;/strong&gt; menjadi &lt;strong&gt;Penghasilan\n     - Tabungan = PENGELUARAN. &lt;/strong&gt;Karena bank akan melihat arus\n     keuangan kita lewat rekening.&lt;br&gt;&lt;br&gt;4. KPR itu lebih\n     baik dari bayar tunai. Orang cenderung menabung dulu biar bisa membeli\n     rumah dengan tunai. Padahal, ketika tabungan sudah cukup, harga properti\n     sudah jauh melambung.&lt;br&gt;&lt;br&gt;5. Bank adalah\n     mitra kerja dan mitra usaha.&lt;br&gt;&lt;br&gt;&lt;p&gt;Selamat\nberKPR :)&lt;/p&gt;', '2013-03-11', 1, 'icon-rumah-bersih1_thumb.jpg', 'icon-rumah-bersih1.jpg'),
(6, 'Hal Penting Sebelum Menaksir Harga Rumah di Makassar', 'Untuk menaksir harga sebuah rumah, Anda harus\nmengetahui dua komponen utamanya. Dengan memahami hal ini, Anda bisa menentukan\nmanakah rumah yang lebih tepat untuk dibeli. Dua komponen yang memengaruhi harga\nrumah itu adalah &lt;a href=&quot;http://rumahta.com&quot; target=&quot;&quot;&gt;harga tanah dan harga bangunan&lt;/a&gt;. &lt;br&gt;&lt;br&gt;Untuk mengetahui harga\ntanahnya, dapat dilihat dari permintaan (&lt;i&gt;demand&lt;/i&gt;), penawaran (&lt;i&gt;supply&lt;/i&gt;),\nstatus kepemilikan (contohnya girik, SIP, SHGB, SHM, SKJ), dan perizinan lahan (seperti\nGSB, golongan pemugaran).\n\nHarga tanah juga bisa ditentukan dari strukturnya,\napakah rendah di depan atau tinggi di kanan, juga dilihat dari sifat tanahnya,\nmisalnya tanah rawa atau tanah liat. Kemudian, bentuknya, baik trapesium,\npersegi panjang, simetris, maupun bentuk lainnya.\n\n&lt;br&gt;&lt;br&gt;Posisi juga menentukan, begitu pula dengan letaknya.\nKelengkapan fasilitas umum dan khusus di sekitar rumah, rencana pengembangan\nkawasan, serta siapakah &lt;a href=&quot;http://rumahta.com&quot; target=&quot;&quot;&gt;pengembangnya juga memengaruhi harga tanah&lt;/a&gt; .\n\nSementara itu, harga bangunan bisa dilihat dari\nbeberapa hal, seperti usia bangunan, material pendukungnya, konsep\narsitekturnya, serta siapakah arsitek dan kontraktornya. Semakin lengkap data\nini, maka harganya akan semakin mahal. Namun, kondisinya tetap aman dari sisi\nhukum.\n\nSumber: &lt;span&gt;properti.kompas.com&lt;/span&gt;', '2013-03-11', 1, 'Price-Tag_thumb.jpg', 'Price-Tag.jpg'),
(11, 'Bisnis Properti di Makassar Dengan Sedikit Modal', '&lt;p&gt;&amp;nbsp;\n\n&lt;/p&gt;&lt;p&gt;Pada\ndasarnya &lt;b&gt;&lt;a href=&quot;http://rumahta.com/&quot;&gt;bisnis properti&lt;/a&gt;&lt;/b&gt; membutuhkan\nbiaya yang sangat besar. Tetapi tidak semua orang memiliki cukup modal untuk\nmemulai bisnis. Terdapat orang yang ingin memulai bisnis properti tetapi tidak\nmemiliki modal yang cukup. Jika Anda adalah salah satu dari orang tersebut,\nAnda tidak perlu khawatir karena terdapat tips yang memandu untuk memulai\nbisnis properti dengan sedikit modal.&lt;/p&gt;\n&lt;p&gt;Berikut ini\ntips memulai bisnis properti dengan sedikit modal :&lt;/p&gt;\n\n&lt;b&gt;1. Mencari rumah atau properti bekas.&lt;/b&gt;&lt;br&gt;\n     Mencari rumah atau properti yang tidak baru, properti yang sudah digunakan\n     sebelumnya tetapi masih memiliki kondisi yang bagus atau layak huni.&lt;br&gt;&lt;br&gt;\n     &lt;b&gt;&lt;span&gt;2. Mencari properti di lokasi\n     strategis.&lt;/span&gt;&lt;/b&gt;&lt;br&gt;\n     Usahakan untuk mencari lokasi properti yang bagus dan mempunyai\n     pertumbuhan atau pengembangan ke depan.&lt;br&gt;&lt;br&gt;\n     &lt;b&gt;&lt;span&gt;3. Mencari properti yang bisa dijadikan\n     tempat usaha.&lt;/span&gt;&lt;/b&gt;&lt;br&gt;\n     Properti yang didalamnya ada bisnis atau tempat usaha, seperti : Rumah\n     sewaan, kos-kosan yang sedang berjalan dan sudah ada penyewanya, gedung\n     komersial yang sudah berjalan dan ada penyewanya, rumah yang ada bisnisnya\n     (toko, warnet, laundry dll).&lt;br&gt;&lt;br&gt;\n     &lt;b&gt;&lt;span&gt;4. Kerjasama dengan agen properti,\n     teman dan relasi Anda&lt;/span&gt;&lt;/b&gt; &lt;br&gt;\n     Untuk mendapatkan informasi rumah atau properti yang dipasang tulisan\n     untuk di DIJUAL.&lt;br&gt;&lt;br&gt;\n     &lt;b&gt;&lt;span&gt;5. Cari di&amp;nbsp; media lokal\n     (koran, majalah, dsb) atau &lt;a href=&quot;http://rumahta.com/&quot;&gt;Internet&lt;/a&gt;.&lt;/span&gt;&lt;/b&gt;&lt;span&gt;Cari\n     bagian iklan baris yang menjual properti, fokuskan Anda mencari properti\n     yang mempunyai arus kas dan harga di bawah pasar. Kata-kata kunci yang\n     biasanya mengindikasikan properti murah dibawah harga pasar dan memiliki\n     arus kas diantaranya adalah, dijual Butuh Uang (BU) atau dijual Cepat.&lt;br&gt;&lt;br&gt;\n     &lt;b&gt;&lt;span&gt;6. Mengajukan pinjaman dana ke\n     bank.&lt;/span&gt;&lt;/b&gt;&lt;br&gt;\n     Pinjaman dana tersebut Anda gunakan untuk menyewa sebuah bangunan atau\n     rumah, kemudian bangunan tersebut Anda sewakan untuk kepentingan bisnis\n     yang besar seperti mini market dan sejenisnya.&lt;br&gt;&lt;br&gt;\n     &lt;b&gt;&lt;span&gt;7. Melakukan &lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;b&gt;&lt;a href=&quot;http://rumahta.com&quot; target=&quot;&quot;&gt;pemasaran/marketing online&lt;/a&gt;&lt;/b&gt;&amp;nbsp;&lt;span&gt;&lt;b&gt;&lt;span&gt; atau offline.&lt;/span&gt;&lt;/b&gt;&lt;br&gt;\n     Setelah memiliki properti yang diinginkan, Anda pasarkan via internet di &lt;a href=&quot;http://rumahta.com/&quot;&gt;Rumahta.com&lt;/a&gt; atau iklan baris di media\n     cetak.\n\n&lt;p&gt;Bisnis\nproperti adalah bisnis yang menjanjikan dan bisa mendatangkan keuntungan\nSelamat mencoba dan sukses selalu.&amp;nbsp;&lt;/p&gt;\n\n&lt;/span&gt;', '2013-03-02', 1, 'rumahta.com__thumb.jpg', 'rumahta.com_.jpg'),
(7, 'Investasi Manakah yang Lebih Menuguntungkan, Ruko atau Toko di Makassar?', 'Menginvestasikan uang Anda untuk tempat usaha memang\nmenarik. Hal ini mengingat banyak orang membutuhkan tempat untuk menjalankan\nusahanya. Nah, pilihannya apakah mau investasi berupa ruko (rumah toko) atau\ntoko saja?\nYang pasti kedua properti itu masing ada kelebihan dan\nkekurangannya. Hal ini tergantung kebijakan pilihan anda sendiri. \n\nBerikut ini keuntungan dan\nkeuntungan berinvestasi di ruko dan toko:&lt;br&gt;\n&lt;br&gt;\n&lt;b&gt;&lt;u&gt;Investasi ruko&lt;/u&gt;&lt;/b&gt;&lt;br&gt;\nBerinvestasi di tempat usaha jenis ruko, kelebihannya adalah:&lt;a href=&quot;http://rumahta.com&quot; target=&quot;&quot;&gt; Permintaan ruko tinggi terutama untuk menyuplai di kawasan bisnis&lt;/a&gt;&amp;nbsp; ,\n     perdagangan, dan entertainment.Investasi relatif lebih cepat karena jangka waktu penyewaan 2 - 3\n     tahun.Cap rate ruko berkisar 6% - 9%. Dengan angka ini, tingkat pengembalian\n     lebih besar dibandingkan rumah sewa.Ruko cepat laris karena biasanya berada di daerah yang ramai dan\n     prospektif secara ekonomi.&lt;br&gt;&lt;br&gt;Namun, berinvestasi ruko juga ada kekurangannya,\nyaitu:\n\nSifatnya rentan terhadap kisis ekonomi. Bila krisis terjadi, bisa\n     dipastikan permintaan rumah sewa berkurang.Prospek bisnis ruko sangat tergantung lokasinya.\n\n&lt;br&gt;&lt;br&gt;\n&lt;b&gt;&lt;u&gt;Investasi toko&lt;/u&gt;&lt;/b&gt;&lt;br&gt;\nSementara itu, investasi toko memiliki kelebihan:\n\nMemiliki demand tinggi terutama di kawasan perdagangan.Investasi juga cepat kembali karena jangka waktu sewanya 2 - 3 tahun.Capital gain diperoleh dalam waktu jangka panjang (lebih dari lima\n     tahun). Makin ramai dan banyak transaksi di sebuah lokasi toko, maka\n     capital gain semakin tinggi.\n\nNamun, kekurangannya adalah:\n\nSulitnya mendapatkan &lt;a href=&quot;http://rumahta.com&quot; target=&quot;&quot;&gt;lokasi toko yang strategis&lt;/a&gt; .Harga bisa jatuh bisa salah memilih lokasi.\n\n&lt;br&gt;\n&lt;i&gt;Sumber&lt;/i&gt; : &lt;span&gt;properti.kompas dot com&lt;/span&gt;', '2013-03-11', 1, 'bingung_thumb.jpg', 'bingung.jpg'),
(9, 'Cara untuk Memulai Bisnis Broker Properti', '&lt;p&gt;Pelajarilah bisnis agen properti yang sudah berjalan,\nkhususnya calon kompetitor di sekeliling wilayah Makassar akan beroperasi yang\nsudah mempunyai brand. Buatlah studi kelayakan SWOT (Strengths, Weaknesses,\nOpportunities and Threats) untuk mengukur kekuatan, kekurangan dan peluang\nserta kendala jika anda membuka bisnis baru tersebut.&lt;br&gt;\n&lt;br&gt;\nBuatlah sistem yang menarik dan berbeda dari bisnis sejenis yang sudah ada.\nMisalnya: sistem rumenarasi para agen-agen properti yang akan bekerja dengan Anda.\nKomisi dan bonus yang menarik akan membuat mereka bersemangat bekerja untuk Anda.&lt;br&gt;\n&lt;br&gt;\nBerikan pelatihan yang berkesinambungan terhadap para agen, mulai dari\npelatihan penampilan, komunikasi, cara penjualan, pelatihan untuk mendapatkan\nlisensi penjual properti dan pelatihan-pelatihan lainnya. Buat juga seminar\nagen properti untuk merekrut para agen baru.&lt;br&gt;\n&lt;br&gt;\nKantor usaha bisnis agen properti Anda pun harus representative dengan baik dan\nnyaman. Pengunjung akan lebih yakin jika kantor Anda terlihat rapi dan\ninformatif serta pelayanan yang baik. Begitu juga dengan para agen dan\nkaryawan, mereka akan lebih nyaman bekerja. Siapkan juga fasilitas telpon,\nkomputer dan internet agar para agen dengan mudah berkomunikasi dengan calon\npembeli dan pemilik properti. Juga siapkan fasilitas transportasi untuk\nkegiatan kunjungan ke pemilik properti dan calon pembeli.&lt;br&gt;\n&lt;br&gt;\nSebagai penjual properti, Anda dan tim penjualan harus dapat mempunyai\nkemampuan untuk memberikan pelayanan yang baik kepada pemilik properti dan\ncalon pembeli. Jadilah mitra dan sahabat mereka, berikan solusi kepada mereka.\nMereka bukanlah objek untuk mendapatkan pendapatan Anda. Emotional benefit\nlebih dibutuhkan mitra Anda tersebut. &lt;br&gt;\n&lt;br&gt;\nMisalnya kepada pemilik properti, berikan solusi agar bagaimana menyiapkan\npropertinya agar layak dijual dan mempunyai nilai yang tinggi. Kepada calon\npembeli, berikanlah solusi rumah dan properti yang tepat dan harga yang layak\nsesuai kebutuhan mereka, sehingga tidak asal memberikan properti yang\nsebenarnya tidak sesuai kebutuhannya. Siapkan waktu 24 jam untuk mereka.&lt;br&gt;\n&lt;br&gt;\nBisnis agen properti juga tidak sekedar &lt;a href=&quot;http://rumahta.com/&quot;&gt;menjual\nrumah atau properti&lt;/a&gt;. Anda pun harus dapat memberikan nilai tambah dengan\nmemberikan pelayanan yang dibutuhkan pelanggan dan mitra, misalnya: pelayanan\npengurusan notaris, sertifikat, perpajakan jual beli, konsultasi renovasi\nproperti dan taman, akses perbankan dan pengurusan pemasangan PLN, PAM, telepon\nhingga internet.&lt;br&gt;\n&lt;br&gt;\nSiapkan media informasi yang lengkap baik bagi pemilik properti, calon pembeli maupun\npara agen properti. Medianya bisa melalui brosur, booklet, papan informasi,\nspanduk &lt;a href=&quot;http://rumahta.com/&quot;&gt;hingga website&lt;/a&gt;. &lt;br&gt;\n&lt;br&gt;\nAnda harus mempunyai listing properti yang dijual, daftar listing dapat\ndiperoleh dari berbagai sumber: koran, internet, rumah-rumah yang tertulis dijual,\ninformasi rumah dijual dari para kerabat dan lainnya.&lt;br&gt;\n&lt;br&gt;\nMedia promosi juga harus dianggarkan budgetnya, misalnya: pasang iklan di media\nsurat kabar, &lt;a href=&quot;http://rumahta.com/&quot;&gt;iklan online&lt;/a&gt;, spanduk,\npenyebaran brosur, majalah kawasan dan lainnya.&lt;/p&gt;\n\n&lt;p&gt;(detik.com)&lt;/p&gt;', '2013-03-11', 1, 'foto_3_thumb.jpg', 'foto_3.jpg'),
(12, 'Broker properti Makassar melirik pasang iklan di rumahta.com', 'Perusahaan broker properti di Makassar mulai gemar berjualan lewat media online.\nRespons yang datang melalui iklan di internet semakin banyak kendati angkanya belum\nmengalahkan iklan di media cetak.\n\nMenurut dia, tarif iklan printed media tinggi namun unggul dalam keluasan\njangkauan. Nah, media &lt;em&gt;online&lt;/em&gt; berbiaya murah, tapi fokus ke segmen\nmarket tertentu. Selain itu, bisa ditayangkan dalam jangka waktu yang cukup\npanjang. &quot;Makanya yang respons pun cukup banyak&quot;.&lt;br&gt;\n&lt;br&gt;\nAmbil contoh di harian umum nasional, tarif per baris per milimeterkolom\ndikenakan biaya Rp 47.300. Sedangkan tarif di media lokal Makassar sekitar Rp 12\njuta per halaman. Nah, tarif iklan properti online di &lt;a href=&quot;http://rumahta.com/&quot;&gt;rumahta.com&lt;/a&gt; cukup murah dengan harga rata-rata\nRp 100.000 per tahun. Keuntungan lain, produk yang dipromosikan bisa banyak\nkarena bisa diganti-ganti. &lt;br&gt;\n&lt;br&gt;\nSekalipun memiliki daya jangkau luas, komunikasi media cetak hanya satu arah.\nMakanya, banyak yang memanfaatkan media cetak cuma untuk informasi. &lt;a href=&quot;http://rumahta.com/&quot;&gt;Media iklan properti online rumahta.com&lt;/a&gt; sekarang\nsudah dapat diakses kapan dimana saja melalui komputer/laptop, tablet dan\nsmartphone.&lt;br&gt;\n&lt;br&gt;\n&lt;a href=&quot;http://rumahta.com/&quot;&gt;Media iklan properti online rumahta.com&lt;/a&gt; sangat\npas untuk meluncurkan produk atau klaster baru. Dapat diramalkan 50% pembeli\nproperti berburu produk via &lt;em&gt;online&lt;/em&gt;.', '2013-03-19', 1, 'iklan-online-rumahta.com__thumb.jpg', 'iklan-online-rumahta.com_.jpg'),
(13, 'Beberapa Tips Menawar Harga Rumah di Makassar', '&lt;p&gt;Buat yang ingin membeli rumah di Makassar pastikan\nAnda mendapatkan harga yang sesuai, jangan sampai malah mendapatkan rumah\ndengan harga yang mahal namun minim fasilitas. Ada\ntrik tersendiri yang dapat Anda terapkan agar mendapatkan harga rumah yang\npantas.&lt;/p&gt;\n\n&lt;p&gt;1.Perhatikan &lt;a href=&quot;http://rumahta.com/&quot;&gt;kondisi bangunan rumah&lt;/a&gt; yang akan Anda beli.\nCermati secara detil apakah diperlukan banyak renovasi pada bangunan tersebut.&lt;/p&gt;\n\n&lt;p&gt;2.Cari tahu sudah berapa\nlama rumah tersebut ditawarkan untuk dijual. Dari sini Anda dapat melihat\ngambaran tentang respon calon pembeli lainnya. Jika rumah tersebut sudah\nditawarkan&amp;nbsp; dalam waktu yang lama, ada kemungkinan si pemilik sudah ingin\nmelepas rumah tersebut segera dan kesempatan ini bisa Anda manfaatkan.&lt;/p&gt;\n\n&lt;p&gt;3.Cari informasi tentang\nharga rumah yang ditawarkan tersebut dan bandingkan dengan harga beberapa rumah\ndi sekitar atau di &lt;a href=&quot;http://rumahta.com/&quot;&gt;rumahta.com&lt;/a&gt;, apakah\nmendekati sama atau tidak. Tentunya Anda harus membandingkan dengan type yang\nsejenis, dan dengan mengetahui harga rumah rata-rata di wilayah tersebut, maka\ndengan mudah Anda dapat menentukan penawaran harga.&lt;/p&gt;\n\n&lt;p&gt;4.Temukan alasan kenapa\nrumah tersebut dijual agar Anda dapat menentukan jumlah penawaran awal. Apakah &lt;a href=&quot;http://rumahta.com/&quot;&gt;rumah tersebut dijual&lt;/a&gt; karena kebutuhan mendesak\npemilik atau hanya untuk mendapat keuntungan dari investasi properti yang dia\nmiliki.&lt;/p&gt;\n&lt;p&gt;Setelah mendapatkan informasi-informasi tersebut Anda akan mendapat\ngambaran tentang harga standar dan informasi pendukung lainnya untuk rumah yang\nakan Anda beli. Berbekal informasi tersebut, lakukan penawaran harga kepada si\npemilik. Tawarlah dengan harga yang sesuai atau mendekati dengan harga pasaran,\ndan untuk mencapai sepakat Anda diharuskan untuk jeli dan memiliki kemampuan\nnegosiasi.&lt;/p&gt;', '2013-03-06', 1, 'rumah-murah-rumahta.com__thumb.jpg', 'rumah-murah-rumahta.com_.jpg'),
(14, 'Bagaimanakah Menentukan Harga Sewa Kost-Kostan di Makassar?', 'Anda ingin\nmemulai bisnis kos-kosan di Makassar? Salah satu hal penting yang tidak mudah\nuntuk dijadikan keputusan adalah menentukan harga sewa kos-kosan. Bila harga\nsewa yang ditawarkan terlalu tinggi akan menyebabkan kost-kostan ditinggalkan\noleh penyewanya dan tidak diminati oleh calon penyewa baru. Hal ini tentunya\nakan merugikan &lt;a href=&quot;http://rumahta.com/&quot;&gt;bisnis kost-kostan&lt;/a&gt; Anda.\n\n&lt;br&gt;&lt;br&gt;Lalu\nbagaimanakah cara menentukan harga sewa kost-kostan Anda yang tepat? Berikut\nadalah ulasannya. Berdasarkan kondisi normal di pasaran, harga sewa kost-kostan\nhendaknya menyesuaikan dengan harga sewa rata-rata yang berlaku di wilayah kost-kostan\ntersebut. Dengan harga sewa yang terjangkau oleh target pasar, maka bisnis kost-kostan\nAnda akan mendapat banyak peminat.\n\n&lt;br&gt;&lt;br&gt;Berbeda\nhalnya bila kebutuhan akan kost-kostan di wilayah tersebut lebih besar daripada\njumlah kost-kostan yang tersedia. Kondisi seperti ini memungkinkan Anda untuk\nmenentukan harga sewa yang lebih tinggi dari harga sewa pada kondisi normal.\n\n&lt;br&gt;&lt;br&gt;Penentuan\nharga sewa yang tepat diperlukan untuk mendukung pengembangan bisnis kost-kostan.\nHarga sewa kost-kostan juga dapat ditentukan berdasarkan fasilitas dan\nkelebihan apa saja yang ditawarkan. &lt;br&gt;&lt;br&gt;&lt;b&gt;Hal-hal yang Harus Dilakukan Sebelum Menentukan Harga Sewa Kost-kostan&lt;/b&gt;\n&lt;b&gt;\n&lt;/b&gt;&lt;span&gt;&lt;b&gt;:&lt;/b&gt;&lt;br&gt;&lt;br&gt;&lt;/span&gt;&lt;b&gt;Riset pasar.&lt;/b&gt;\n&lt;br&gt;\nLakukan hal ini untuk mengetahui\nfasilitas apa saja yang ditawarkan oleh kompetitor bisnis sejenis. Baca dan\nlihat di &lt;a href=&quot;http://rumahta.com/&quot;&gt;iklan properti rumahta.com &lt;/a&gt;yang dipasang oleh kompetitor. &lt;br&gt;&lt;br&gt;&lt;span&gt;&lt;b&gt;Perindah kondisi fisik bangunan kos-kosan.&lt;/b&gt;&lt;/span&gt;\n\n&lt;br&gt;Beri fasilitas tambahan yang tidak\ndimiliki oleh kompetitor.\n\n&lt;span&gt;&lt;span&gt;&lt;br&gt;&lt;br&gt;&lt;/span&gt;&lt;b&gt;Tawarkan kontrak sewa jangka panjang.&lt;/b&gt;&lt;/span&gt;\n\n&lt;br&gt;Hal ini untuk menarik calon penyewa\nyang berencana untuk tinggal di wilayah tersebut dalam jangka panjang pula. &lt;span&gt;&lt;span&gt;&lt;br&gt;&lt;br&gt;&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;b&gt;Tawarkan kost-kostan di mana satu kamar dapat dikontrak oleh lebih dari\nsatu orang. &lt;/b&gt;&lt;/span&gt;\n\n&lt;br&gt;Dengan demikian harga sewa kost-kostan\nbisa menjadi lebih murah sehingga lebih menarik minat calon penyewa dengan\nkeuangan terbatas. &lt;span&gt;&lt;span&gt;&lt;br&gt;&lt;br&gt;&lt;span&gt;&lt;/span&gt;&lt;/span&gt;&lt;b&gt;Mengijinkan penyewa untuk membawa hewan peliharaan.&lt;/b&gt;&lt;/span&gt;\n\n&lt;br&gt;Khusus untuk hal ini tentunya\ndibutuhkan perjanjian tersendiri yang meringankan semua pihak, baik Anda\nsebagai pemilik kost-kostan maupun penyewa.\n\n&lt;br&gt;&lt;br&gt;Selain\nhal-hal tersebut di atas, Anda dapat menentukan harga sewa kost-kostan lebih\ntinggi dari harga pasaran bila lokasi kost-kostan lebih strategis dibandingkan\nlokasi &lt;a href=&quot;http://rumahta.com/&quot;&gt;kost-kostan yang ada di Makassar&lt;/a&gt;. Yang\ndimaksud dengan lebih strategis di sini adalah lokasi kost-kostan dekat dengan\nsekolah, perkantoran, pusat perbelanjaan, rumah sakit atau pun fasilitas umum\nlainnya dan mudah dijangkau oleh sarana transportasi umum.', '2013-03-11', 1, 'harga-kost-rumahta.com__thumb.jpg', 'harga-kost-rumahta.com_.jpg'),
(16, 'Cara efektif menjual rumah di Makassar', 'Rumah adalah termasuk kebutuhan dasar manusia. Menjual rumah yang sudah kita\nmiliki adalah gampang-gampang susah di Makassar. Banyak faktor yang\nmempengaruhi apakah rumah kita dapat terjual cepat atau tidak antara lain :\n\n&lt;b&gt;&lt;br&gt;&lt;br&gt;1. Faktor Lokasi&lt;/b&gt;\n\n&lt;br&gt;Lokasi menentukan harga rumah. Dan juga apakah rumah tersebut dapat cepat\nterjual atau tidak. Apakah &Atilde;?&amp;nbsp;rumah tersebut berada di lokasi yang strategis\n: pinggir jalan raya, kawasan strategis, sistem cluster,&Atilde;?&amp;nbsp;dekat ke sarana\numum seperti Mall, bebas banjir dan sebagainya.\n\n&lt;b&gt;&lt;br&gt;&lt;br&gt;2. Faktor Harga&lt;/b&gt;\n\n&lt;br&gt;Sudah tentu kita harus mempertimbangkan faktor harga pasaran untuk rumah\ntersebut di Makassar. Bila terlalu tinggi, maka akan sulit terjual. Namun bila\nkita ingin menjual dengan harga diatas harga pasaran, maka kita perlu\nmempertimbangkan &quot;selling point&quot; yang harus kita tonjolkan dari rumah tersebut\nyang membuat harganya di atas harga pasaran, misalnya dekat ke Shopping Mall.\ninterior dalam yang mewah dan sebagainya.\n&lt;br&gt;&lt;br&gt;Bila faktor - faktor di atas sudah memenuhi maka langkah berikutnya adalah\nbagaimana kita memasarkan rumah tersebut.\n\nBanyak cara yang dapat dilakukan misalnya :\n\n&lt;br&gt;&lt;br&gt;1. Pasang Iklan di Koran\n&lt;br&gt;2. Pasang Iklan properti online di &lt;a href=&quot;http://rumahta.com/&quot;&gt;Rumahta.com&lt;/a&gt;\n\n&lt;br&gt;3. Pemberitahuan ke teman , lingkungan, kenalan dan sebagainya.\n\n&lt;br&gt;4. Melalui jasa agent properti.\n&lt;br&gt;&lt;br&gt;Item ke 4, menggunakan jasa agent properti bagi kebanyakan masyarakat kita\nmasih merupakan hal yang jarang digunakan. Namun banyak KEUNTUNGAN-KEUNTUNGAN\nyang didapat bila kita menggunakan jasa agent properti antara lain :\n\n&lt;b&gt;&lt;br&gt;&lt;br&gt;Dari sisi PENJUAL properti :&lt;/b&gt;\n\n&lt;b&gt;&lt;br&gt;&lt;br&gt;1. Pemasaran&lt;/b&gt;\n\n&lt;br&gt;Agent properti akan merencanakan dan menjalankan pemasaran rumah Anda\nseperti yang sudah disepakati bersama. Sehingga semua urusan pemasaran seperti\npasang iklan, mencari pembeli, menyaring calon pembeli dan sebagainya termasuk menemani calon pembeli dalam melihat rumah, sudah merupakan\ntugas dari agent properti. Sehingga PENJUAL tidak perlu repot dalam melayani\ncalon pembeli, misalnya calon pembeli menghubungi di malam hari dan sebagainya.\nKarena tugas tersebut sudah dihandle oleh agent properti.\n\n&lt;b&gt;&lt;br&gt;&lt;br&gt;2. Perbandingan Harga Properti&lt;/b&gt;\n\n&lt;br&gt;Agent properti akan memberikan perbandingan harga rumah yang akan kita jual\ndengan harga pasaran di kawasan tersebut. Sehingga memudahkan Penjual untuk\nmenentukan harga jual rumah tersebut, tidak terlalu murah dan juga tidak\nterlalu mahal.\n\n&lt;b&gt;&lt;br&gt;&lt;br&gt;3. Negosiasi&lt;/b&gt;\n\n&lt;br&gt;Agent properti akan membantu dalam proses negosiasi harga. Negosiasi\nmemerlukan keahlian khusus sehingga bisa didapat hasil yang menguntungkan.\nAgent properti sudah terlatih dalam hal ini sehingga sangat membantu Penjual dalam\nmendapat harga jual yang terbaik.\n\n&lt;br&gt;&lt;br&gt;Sedangkan keuntungan-keuntungan menggunakan jasa agent properti bagi\nPEMBELI antara lain :\n\n&lt;br&gt;&lt;br&gt;1. Membantu PEMBELI dalam merumuskan spefikasi rumah yang akan dibeli\nsesuai dengan keinginan, lokasi, budget yang tersedia dan sebagainya.\n\n&lt;br&gt;&lt;br&gt;2. Memberikan banyak pilihan rumah sesuai dengan spefikasi rumah yang telah\ndirumaskan di item 1 di atas.\n&lt;br&gt;&lt;br&gt;3. Menginformasikan prosedur dan ketentuan-ketentuan yang berlaku dalam\ntransaksi jual beli rumah.\n&lt;br&gt;&lt;br&gt;4. Membantu PEMBELI untuk mengetahui semua fakta - fakta yang perlu\ndiketahui oleh pembeli sehubungan dengan calon &lt;a href=&quot;http://rumahta.com/&quot;&gt;rumah\nyang akan dibeli&lt;/a&gt;.\n\n&lt;br&gt;&lt;br&gt;5. Membantu PEMBELI untuk proses KPR (Kredit Pemilikan Rumah) bila cara\npembayarannya melalui proses ini.\n\n&lt;br&gt;&lt;br&gt;Melihat fakta-fakta di atas dapat disimpulkan adalah lebih banyak\nmenguntungkan bila kita menggunakan jasa agent properti . Semoga info ini\nbermanfaat dalam &lt;a href=&quot;http://rumahta.com/&quot;&gt;proses jual beli rumah&lt;/a&gt; kita.\n(Dery Worung)', '2013-03-19', 1, 'cara_efektif_rumahta.com__thumb.jpg', 'cara_efektif_rumahta.com_.jpg'),
(17, 'Cara Cepat Menjual Rumah di Makassar melalui Internet', 'Ini\nhanyalah sebuah jalan Cara\nCepat Menjual Rumah di Makassar melalui Internet, dan tidak\nmenjanjikan bahwa bisa berhasil untuk setiap orang. Karena kreatifitas dan\nAktivitas pemasaran adalah kunci Utama saat melakukan Pemasaran Online Baik itu\nuntuk menjual Rumah maupun Menjual barang-barang lainnya.\n&lt;br&gt;&lt;br&gt;Rumahta.com\nmencoba untuk berbagi&amp;nbsp;&lt;em&gt;&lt;span&gt;&lt;a href=&quot;http://rumahta.com/&quot;&gt;Cara Cepat Menjual Rumah di\nMakassar melalui Internet&lt;/a&gt;&lt;/span&gt;&lt;/em&gt;. Tanpa harus keluar modal banyak\nuntuk memasang Iklan seperti di Media Cetak Maupun Media Elektronik.\n\n&lt;b&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;Cara Cepat\nMenjual Rumah di Makassar Melalui Internet di Rumahta.com&lt;/b&gt;\n\n&lt;br&gt;&lt;br&gt;Cara Cepat\nyang pertama Menjual Rumah di Makassar melalui Internet yaitu dengan\nmenggunakan Fasilitas Website media iklan properti online khusus untuk wilayah Sulawesi\nSelatan. &lt;br&gt;&lt;br&gt;Rumahta.com\nadalah media iklan properti online sangat bagus untuk dijadikan tempat untuk\nmenjual rumah Anda khususnya untuk konsentrasi wilayah di Sulawesi Selatan.&lt;b&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;3 Manfaat Besar Menjual Rumah di &lt;a href=&quot;http://rumahta.com&quot; target=&quot;&quot;&gt;Rumahta.com&lt;/a&gt;&lt;/b&gt;&lt;br&gt;&lt;br&gt;\n\n1. Hemat biaya\n     pemasaran. Jika memasang Iklan di Media Cetak atau Elektronik, pemasaran\n     Iklan seperti ini sangatlah banyak pengeluaran untuk biaya pemasangan\n     Iklan. Walaupun ada Media Cetak Harian yang sangat murah. Bisa sampai Rp. 50.000,-/Hari&lt;br&gt;&lt;br&gt;2. Tertarget.\n     Dengan Teknik SEO dan Cara lain untuk menampilkan halaman Iklan yang\n     hendak dijadikan sebuah layanan jual beli. Jika yang diharapkan pembeli\n     dari kelas menengah ke atas, maka target itu bisa cepat tercapai.&lt;br&gt;&lt;br&gt;3. Dicari\n     Konsumen, dan Bukan Mencari Konsumen. Begitulah kalimat yang pas jika anda\n     mengetahui &lt;a href=&quot;http://rumahta.com&quot; target=&quot;&quot;&gt;Cara Cepat Menjual Rumah di Makassar melalui Internet&lt;/a&gt; .', '2013-03-19', 1, 'cepat_jual_rumah_rumahta.com__thumb.jpg', 'cepat_jual_rumah_rumahta.com_.jpg'),
(18, 'Pajak Dalam Jual Beli rumah di Makassar', '&lt;p&gt;Dalam dunia\nbisnis apapun, kita tidak akan lepas dari dunia perpajakan. Dan dalam setiap\ntransaksi jual beli rumah tentunya akan mengandung kewajiban pembayaran pajak.\nPajak-pajak tersebut akan dikenakan kepada pembeli maupun penjual.&lt;br&gt;\n&lt;br&gt;Berikut adalah pajak-pajak yang biasa dikenakan dalam transaksi &lt;a href=&quot;http://rumahta.com&quot; target=&quot;&quot;&gt;jual beli rumah di Makassar&lt;/a&gt; .&lt;/p&gt;\n\n&lt;b&gt;- BPHTB&lt;/b&gt; (Bea Peralihan Hak Atas Tanah\n     dan Bangunan) BPHTB akan dikenakan kepada Pembeli dan dibayarkan ketika\n     terjadi peralihan hak atau penandatanganan Akta Jual Beli di\n     Notaris/Pejabat Pembuat Akta Tanah (PPAT). Pembayaran dapat dilakukan di\n     Bank yang ditunjuk sebagai tempat pembayaran pajak dan dilaporkan ke\n     Kantor Pelayanan Pajak setempat. Cara menghitung BPHTB adalah sebagai\n     berikut : BPHTB = (Harga Jual &acirc;?? Faktor Tidak Kena Pajak*) x 5%.\n\n&lt;i&gt;&lt;br&gt;* Faktor\nTidak Kena Pajak di Makassar bisa ditanyakan langsung ke Notaris Anda.&lt;/i&gt;\n&lt;br&gt;&lt;br&gt;&lt;b&gt;- Pph Final&lt;/b&gt; (Pajak Penghasilan Bersifat\n     Final) Pph Final akan dikenakan kepada Penjual apabila Penjual adalah\n     perseorangan atau Sertifikat Hak Milik (SHM).Untuk Penjual adalah\n     Perusahaan atau Sertifikat Hak Guna Bangunan (SHGB), maka tidak dikenakan\n     Pph Final. Pph Final hanya akan dikenakan apabila nilai transaksi jual\n     beli lebih dari Rp. 59.999.999,99 (lima puluh juta sembilan ratus sembilan\n     puluh sembilan ribu sembilan ratus sembilan puluh sembilan koma sembilan\n     puluh sembilan rupiah). Sama dengan BPHTB, Pph Final dibayarkan ketika\n     terjadi peralihan hak atau penandatanganan Akta Jual Beli di\n     Notaris/Pejabat Pembuat Akta Tanah (PPAT). Pembayaran dapat dilakukan di\n     Bank yang ditunjuk sebagai tempat pembayaran pajak dan dilaporkan ke\n     Kantor Pelayanan Pajak setempat. Cara menghitung Pph Final adalah sebagai\n     berikut : Pph Final = Harga Jual x 5%.\n\n&lt;b&gt;&lt;br&gt;&lt;br&gt;- PPN&lt;/b&gt; (Pajak Pertambahan Nilai) PPN\n     akan dikenakan kepada Pembeli, dipungut oleh Penjual dengan catatan\n     Penjual adalah Pengusaha Kena Pajak (PKP) dan atau &lt;a href=&quot;http://rumahta.com&quot; target=&quot;&quot;&gt;penghasilan dari penjualan rumah&lt;/a&gt;&amp;nbsp; melebihi Rp. 600.000.000,00 (enam ratus juta rupiah) per\n     tahun. PPN dipungut pada saat penerimaan uang muka maupun pelunasan dan\n     dibayarkan selambatnya tanggal 15 bulan berikutnya.&lt;br&gt;&lt;br&gt;\n\n&lt;p&gt;&lt;b&gt;Contoh&lt;/b&gt; Rumah Seharga Rp. 500.000.000,-&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Penjual:&lt;/b&gt;&lt;/p&gt;\n\n&lt;p&gt;Membayar PPh\nTB dengan SSP (Surat Setoran Pajak) Final sebesar 5% dari harga jual&lt;br&gt;\nPPh TB = 5% x Rp 500.000.000&lt;br&gt;\nPPh TB = Rp 25.000.000&lt;br&gt;\nMelaporkan dalam SPT Tahunan PPh Orang Pribadi atas penghasilan dari pengalihan\nhak atas tanah dan/atau bangunan tersebut dalam bagian penghasilan yang\ndikenakan PPh Final&lt;/p&gt;\n\n&lt;p&gt;&lt;b&gt;Pembeli:&lt;/b&gt;&lt;/p&gt;\n\n&lt;p&gt;Membayar\nBPHTB dengan SSB (Surat Setoran BPHTB) sebesar 5% dari NPOPKP dan dengan asumsi\nNPOPTKP pada lokasi tersebut adalah sebesar Rp 60.000.000.&lt;br&gt;\nBPHTB = 5% x (Rp 500.000.000 dikurangi Rp 60.000.000)&lt;br&gt;\nBPHTB = 5% x Rp 440.000.000&lt;br&gt;\nBPHTB = Rp 22.000.000&lt;br&gt;\n&lt;/p&gt;&lt;p&gt;Melaporkan dalam SPT Tahunan PPh Orang Pribadi atas perolehan &lt;a href=&quot;http://rumahta.com&quot; target=&quot;&quot;&gt;tanah dan/atau bangunan&lt;/a&gt;&amp;nbsp; tersebut.&lt;/p&gt;', '2013-03-19', 1, 'Pajak_rumah-rumahta.com__thumb.jpg', 'Pajak_rumah-rumahta.com_.jpg'),
(19, 'Sebelum Membeli Rumah di Makassar Lihat Legalitas Perumahan', '&lt;p&gt;&lt;strong&gt;Untuk mendapatkan hunian yang tepat Anda\nharus melihat sekian banyak rumah di Makassar, sebelum memilih satu di\nantaranya.&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;1.&lt;strong&gt; &lt;/strong&gt;Guna meminimalisir\nkemungkinan serah terima rumah meleset, beli rumah di perumahan Makassar yang\nmemiliki legalitas lengkap. Lihat ke lokasi, apakah proses pematangan tanahnya\nsudah berjalan. Cek secara berkala progress pembangunan rumah. Sesuaikan\npembayaran dengan progress. Pembelian tunai hanya layak untuk rumah siap huni. &lt;/p&gt;\n\n&lt;p&gt;2. Khusus apartemen\nsebaiknya beli yang sudah jadi. &lt;a href=&quot;http://rumahta.com/&quot;&gt;Baik juga bila\ndevelopernya anggota asosiasi seperti REI dan Apersi&lt;/a&gt;. Jadi, kalau ada\nmasalah bisa minta bantuan asosiasi untuk mendisiplinkan anggotanya.&lt;/p&gt;\n\n&lt;p&gt;3. Pastikan jadwal\nserah terima rumah tercantum dalam perjanjian pengikatan jual beli (PPJB) dan\nAJB. Sudah mulai ada developer yang berani menerakan jadwal serah terima dalam\ntanggal, bukan hanya bulan. Jangan menerima saja klausul dalam PPJB karena\nsering menempatkan konsumen dalam posisi lemah. Misalnya, bila terlambat\nmencicil didenda satu permil per hari. Sebaliknya, kalau serah terima rumah\ntelat, developer hanya dikenai pinalti terbatas. Bila hak dan kewajiban para\npihak tidak seimbang, jangan ragu meminta developer memperbaikinya.&lt;/p&gt;\n\n&lt;p&gt;4. Pastikan Anda\nmeneken PPJB dengan developer atau pihak lain yang dikuasakan developer.\nSebaiknya proses PPJB juga dilakukan di hadapan notaris/PPAT yang Anda pilih\natau dari developer. Minta draft PPJB sebelum membayar uang muka. Tak perlu\nkhawatir transaksi batal karena kecerewetan Anda. Masih banyak pilihan rumah\nlain.&lt;/p&gt;\n\n&lt;p&gt;5.&lt;strong&gt; &lt;/strong&gt;Spesifikasi\nbangunan tidak sesuai janji&lt;br&gt;\nDalam brosur developer hanya menyebutkan spesifikasi material secara umum.\nTapi, kini sudah ada beberapa yang berani mencantumkan merek dalam PPJB. Bila\nmemungkinkan beli rumah di perumahan seperti itu. Kalau tidak, minta developer\nmenyebutkan spesifikasi material itu dalam PPJB atau AJB. Cek pembangunan rumah\nuntuk memastikan spesifikasi bangunannya memang sesuai janji. Bila melenceng\nsejak awal Anda bisa mengoreksi.&lt;/p&gt;\n\n&lt;p&gt;6. Bangunan tidak\nrapi&lt;br&gt;\nProblem ini terkait kualitas pemborong yang dipakai developer, dan kita belum\nmemiliki sistem pemeringkatan kontraktor. Karena itu yang bisa dilakukan,\nmelihat finishing rumah contoh, rumah yang sudah jadi, atau rumah di proyek\ndeveloper sebelumnya (kalau ada). Kiat lain dengan mencek proses pembangunan\nrumah, sehingga Anda tahu kualitas pengerjaannya dan bisa segera mengoreksi\nbila ada yang tidak memuaskan. Kalau kualitas rumah tetap tidak sesuai janji,\njangan mau meneken berita acara serah terima.&lt;/p&gt;\n\n&lt;p&gt;7. Pembangunan tidak\nsesuai konsep awal&lt;br&gt;\nPengembangan perumahan memiliki master plan (rencana induk) dan site plan\n(rencana tapak yang lebih detail). Tapi, master plan dan site plan hanya\ninformasi peruntukan lahan: permukiman, fasilitas termasuk ruang terbuka,\nprasarana dan utilitas seperti jalan, selokan, dan jaringan listrik. Konsep\npengembangan perumahan tidak tergambar di master plan. Developer bisa membangun\ndengan konsep apapun sepanjang tidak menyalahi master plan dan site plan.\nMungkin ada fasilitas yang wajib disediakan seperti sekolah, klinik, dan rumah\nibadah. Tapi, boleh jadi developer hanya wajib menyediakan lahan. Sementara\nfasilitas seperti mal atau club house bersifat opsional. Karena itu kalau\ndeveloper berkoar akan mengembangkan rumah taman bergaya klasik dilengkapi club\nhouse, tak ada yang bisa Anda pegang kecuali komitmennya. Yang diperjanjikan\ndalam PPJB dan AJB hanya rumah. Upaya yang bisa dilakukan agar janji itu\ndipenuhi, adalah dengan membeli di perumahan yang dikembangkan developer dengan\nreputasi cukup baik. Selebihanya lebih baik berkonsentrasi memastikan posisi\nrumah: jauh dari gardu listrik, tidak di bawah saluran listrik tegangan tinggi,\ntidak akan tergusur jalan tol, dan lain-lain. Untuk itu cek langsung ke lokasi\nkarena semua itu tidak tergambar di master plan.&lt;/p&gt;\n\n&lt;p&gt;8.&lt;strong&gt; &lt;/strong&gt;Ukuran kaveling\ntidak sesuai sertifikat&lt;br&gt;\nKasus ini biasanya terjadi pada kaveling sudut (hook) atau di pinggir blok yang\nmemiliki sisa tanah. Untuk menangkalnya, lihat denah kaveling hasil pengukuran\nkantor pertanahan. Tanyakan juga sistem developer menghitung luas bangunannya.\nKalau kurang yakin, minta diukur ulang. Kekurangan hingga lima persen masih\nbisa ditoleransi. Pastikan ukuran kaveling resmi tercantum dalam PPJB dan AJB\ntermasuk posisinya di site plan. Untuk itu tambahkan klausul sanksi bagi\ndeveloper bila saat serah terima, luas kaveling tidak sesuai AJB. Lakukan\ntransaksi di hadapan notaris/PPAT. Sebaiknya beli rumah dengan fasilitas KPR\nkarena bank akan ikut memastikan luas kaveling dan bangunannya.&lt;/p&gt;\n\n&lt;p&gt;9. Kaveling\ndipindahkan tanpa persetujuan konsumen&lt;br&gt;\nMasalah ini bisa diantisipasi dengan meminta developer menambahkan klausul\npemindahan posisi kaveling dalam PPJB. Untuk itu di PPJB pastikan posisi\nkaveling Anda sesuai site plan.&lt;/p&gt;\n\n&lt;p&gt;10.&lt;strong&gt; &lt;/strong&gt;Komplain tidak\nditanggapi selama masa garansi&lt;br&gt;\nIni juga bisa diatur dalam PPJB. Sampaikan komplain secara lisan dan tertulis,\ndan pastikan developer menerimanya. Bila tidak ditanggapi, tak ada salahnya\nmenulis surat di koran, meminta bantuan asosiasi developer, atau bahkan membawa\nkasusnya ke badan penyelesaian sengketa konsumen (BPSK) atau YLKI. Problem juga\nbisa diminimalisir dengan mencek proses pembangunan, agar Anda mengetahui sejak\ndini potensi masalah pada rumah dan segera meminta developer mengatasinya. Cek\nsecara seksama kondisi rumah sebelum serah terima, termasuk kondisi\nutilitasnya.&lt;/p&gt;\n\n&lt;p&gt;11. Pengelolaan\nlingkungan tidak memuaskan&lt;br&gt;\nSelama masa pengembangan, pengelolaan lingkungan biasanya ditangani estate\nmanagement yang dibentuk developer, didukung estate regulation berikut iuran\npengelolaan (IPL)-nya. Anda bisa melihat kualitas pengelolaan dan estate\nregulation itu saat membeli rumah.Bila kurang sreg Anda bisa mencari rumah\nlain, atau meneruskan transaksi dan bersama penghuni lain membentuk perhimpunan\nuntuk mendesakkan perbaikan. Dalam hal ini harus jelas standar pengelolaan\nlingkungan yang diinginkan, karena akan berujung pada nilai iuran yang harus\ndibayar. Selain itu dengan standar yang jelas, puas atau tidak puas lebih\nterang ukurannya. Yang repot sering di sebuah perumahan baru sedikit yang\nmendiami rumahnya, sehingga banyak pemilik menunggak iuran yang berdampak pada\npengelolaan lingkungan. Karena itu upayakan membeli rumah di perumahan yang\nbanyak dihuni dan bukan sekedar ajang investasi.&lt;/p&gt;\n\n&lt;p&gt;12. Banyak rumah\nberalih fungsi&lt;br&gt;\nMasalah ini juga efektif diatasi bila ada persatuan warga. Pasalnya, developer\npun kesulitan mencegahnya karena rumah sudah menjadi milik penghuni. Sebaiknya\nada kesepakatan warga untuk tidak mengubah peruntukan rumah, karena bukan hanya\nmelanggar tapi juga mengganggu penghuni lain. Bila ada yang bandel, selain\nkepada developer, sampaikan juga keluhan ke pemerintah setempat yang berwenang\nmeluruskannya. Hal serupa juga perlu dilakukan terhadap perubahan bentuk rumah.\nBaik juga meminta developer mengatur tegas soal alih fungsi dan renovasi rumah\nitu dalam estate regulation.&lt;/p&gt;\n\n&lt;p&gt;13.&lt;strong&gt; &lt;/strong&gt;Fasilitas tidak\ndirealisasikan&lt;br&gt;\nMasalah ini sudah dibahas di bagian ketujuh. Yang bisa Anda tanyakan hanya fasilitas\nyang wajib disediakan sesuai dengan master plan, dan mengadukan ke pemerintah\nsetempat bila developer tidak merealisasikannya. Fasilitas selebihnya\ntergantung komitmen developer yang sulit dituntut secara hukum bila tidak\ndibangun.&lt;/p&gt;\n\n&lt;p&gt;14. Perumahan terendam\nbanjir&lt;br&gt;\nLazimnya setiap perumahan sudah memperhitungkan potensi banjir. Kontrol\nterhadap kemungkinan itu berada di tangan pemda yang menerbitkan izin. Biasanya\npatokan yang dipakai adalah peil (ukuran ketinggian) banjir setempat. Jadi,\ntanyakan kepada developer peil banjir itu. Tanya juga warga di sekitar\nperumahan mengenai kondisi kawasan, apakah tergenang saat hujan lebat atau\ntidak. Lihat posisi perumahan terhadap aliran sungai, apakah cukup dekat dan\ncukup tinggi, dan apakah air bisa dilepas dengan leluasa ke sungai dan selokan.\nPerumahan mestinya dilengkapi drainase memadai dan areal resapan seperti ruang\nterbuka dan sumur resapan yang terpelihara cukup baik. Dalam sebagian kasus\nbanjir lebih disebabkan oleh buruknya pengelolaan kota dan rusaknya area\nresapan air di hulu. Tapi, baik juga menyimpan brosur berisi janji-janji\ndeveloper sampai rumah selesai dibangun dan dihuni. Jadi, bila perumahan\nkebanjiran ada bahan untuk menuntut.&lt;/p&gt;\n\n&lt;p&gt;15.&lt;strong&gt; &lt;/strong&gt;Developer tidak\nmembangun rumah&lt;br&gt;\nProblem ini terjadi kalau membeli rumah di perumahan yang tidak jelas\nlegalitasnya. Karena itu saat membeli yang pertama dicek adalah legalitasnya.\nSupaya lebih aman beli dengan KPR karena bank akan ikut menelisik legalitas dan\nreputasi developer. Bisa saja legalitas lengkap tapi konsep perumahan terlalu\nmuluk sehingga pengembangannya macet. Pegangan Anda hanya track record\ndeveloper, dengan menelusuri proyek-proyek sebelumnya dan animo konsumen\nterhadap proyek-proyek itu. Kalau cukup diminati berarti developernya relatif\nterpercaya. Melelahkan, memang proses mencari rumah. Jangan heran dalam dunia\nreal estate dikenal rumus: melihat 100 rumah, menawar 10 unit, menghitung harga\ntiga di antaranya, sebelum memutuskan membeli satu. Yoenazh K Azhar, Bunga\nPertiwi&lt;/p&gt;\n\n&lt;table&gt;\n &lt;tbody&gt;\n&lt;/tbody&gt;&lt;/table&gt;\n\n&lt;p&gt;Bisa jadi\npermohonan KPR Anda (katakanlah di Bank A) ditolak hanya karena bank yang Anda\npilih itu bukan bank yang memberikan kredit konstruksi (misalnya Bank B) di\nperumahan yang hendak Anda beli. Hal ini jamak dalam dunia perbankan karena\nkredit konstruksi memakai agunan sertifikat induk perumahan.&lt;/p&gt;\n\n&lt;p&gt;Sepanjang\ndeveloper membayar kredit konstruksi ke Bank B lancar sebetulnya tidak jadi\nsoal. Bank B tinggal menyerahkan sertifikat yang sudah dipecah, dan sebagai\ngantinya menerima dana sebesar KPR yang diminta konsumen dari Bank A yang\nbertindak sebagai penyalur KPR. Yang jadi masalah jika pembayaran kredit\nkonstruksinya bermasalah, pasti developer akan menemui kesulitan dalam mengurus\npemecahan sertifikat.&lt;/p&gt;\n\n&lt;p&gt;Bank\npenyalur KPR lazimnya tidak mau mengambil risiko dan menolak permohonan KPR\nAnda. Ini menjelaskan kenapa di sejumlah perumahan developer membatasi pilihan\nKPR di bank tertentu. Dalam hal ini yang bisa Anda lakukan adalah mencari\nperumahan yang kredit konstruksinya tidak bermasalah, perumahan yang sertifikatnya\nsudah dipecah, atau perumahan yang &lt;a href=&quot;http://rumahta.com/&quot;&gt;kredit\nkonstruksi dan KPR-nya dari bank yang sama&lt;/a&gt;.&lt;/p&gt;\n\n&lt;p&gt;16. Bunga KPR naik, cicilan\nmeningkat&lt;br&gt;\nUmumnya bank penyalur KPR saat ini menerapkan sistem bunga efektif floating\n(mengambang). Sistem bunga ini sensitif terhadap perubahan bunga pasar. Bila\nbunga pasar naik, bunga KPR ikut naik sehingga cicilan bulan berikutnya juga\nmeningkat.&lt;br&gt;\nAda beberapa kiat untuk mengatasinya. Misalnya, mengajukan KPR dengan angsuran\nkurang dari 1/3 penghasilan. Jadi, kalau gaji Rp.5 juta, ambil KPR dengan\ncicilan maksimal Rp.1,5 juta/bulan. Dengan demikian bila ada kenaikan bunga,\npenghasilan Anda masih memungkinkan menutup peningkatan cicilan.&lt;/p&gt;\n\n&lt;p&gt;Anda juga\nbisa mengambil program bunga fixed beberapa tahun yang sekarang banyak\nditawarkan bank. Dengan bunga fixed cicilan KPR tidak berubah selama,\nkatakanlah 2 &acirc;?? 3 tahun. Saat bunga fixed berakhir, gaji Anda boleh jadi sudah\nmampu menutup kenaikan cicilan. &lt;/p&gt;\n\n&lt;p&gt;Atau,\nmengambil KPR dari bank dengan sistem bunga anuitas yang relatif lebih stabil\n(berubah setiap tahun bila bunga pasar berubah). Kalau masih was-was juga, cari\nbank yang menyalurkan KPR dengan bunga flat atau KPR bank syariah yang\ncicilannya tetap selama masa KPR. Hanya periode KPR dengan sistem bunga ini\nlebih pendek (kurang dari 10 tahun).&lt;/p&gt;\n\n&lt;p&gt;17. KPR lunas, sertifikat rumah\nbelum diserahkan&lt;br&gt;\nTanah perumahan yang dikembangkan developer umumnya berasal dari banyak\npemilik. Karena itu statusnya juga beraneka. Ada yang baru girik, ada yang\nsudah HGB (SHGB) dan hak milik (SHM), ada yang bahkan tidak dilengkapi dokumen.\nSetelah dibeli semua tanah itu disertifikatkan atas nama developer dengan\nstatus HGB. Inilah yang disebut sertifikat induk.&lt;/p&gt;\n\n&lt;p&gt;Saat tanah\ndikaveling-kaveling dan dipasarkan berikut bangunan, sertifikat induk itu\ndipecah atas nama konsumen, juga dengan status HGB. Dalam praktik SHGB bersama\ndokumen lain seperti IMB dan akta jual beli (AJB), diterima bank dari developer\ndalam 12 bulan sejak konsumen melunasi bea balik nama (BBN). Jadi, bila Anda\nmengambil KPR berjangka dua tahun, bank bisa langsung menyerahkan sertifikat\nbegitu kredit lunas.&lt;br&gt;\n&lt;br&gt;\nTapi, ada saja masalah yang membuat sertifikat belum bisa dipecah dan\ndiserahkan developer ke bank. Misalnya, konflik antarpemegang saham di\nperusahaan developer yang membuat pemecahan sertifikat terbengkalai. Atau untuk\nmenghemat biaya, pengurusan sertifikat dilakukan sekaligus setelah satu tahap\npengembangan selesai melalui oknum kantor pertanahan dan bukan notaris/PPAT.&lt;/p&gt;\n\n&lt;p&gt;Sebelum\nrampung si oknum dimutasi ke bagian lain, sehingga data-data dan dokumen\nkonsumen yang sudah diserahkan developer berceceran. Akibatnya, pengurusan\nharus diulang melalui oknum pejabat yang baru. Pemecahan sertifikat pun\ntertunda.&lt;br&gt;\nSama dengan kasus penolakan KPR, pemecahan sertifikat juga bisa terkendala\nkarena kredit konstruksi bermasalah, sementara konsumen menerima KPR dari bank\nyang berbeda dengan bank penyalur kredit konstruksi. Akibatnya, developer tidak\nbisa memproses pemecahan sertifikat karena sertifikat induk sudah diagunkan di\nbank penyalur kredit konstruksi.&lt;br&gt;\n&lt;br&gt;\nBahkan, yang paling ekstrim pemecahan sertifikat tidak bisa dilakukan karena\nlegalitas tanah bermasalah, atau developer belum mengantungi surat izin\nperuntukan penggunaan tanah (SIPPT) dan IMB.&lt;/p&gt;\n\n&lt;p&gt;Agar tidak\nmengalami masalah ini, sebaiknya beli rumah di perumahan yang kredit konstruksinya\ntidak bermasalah, atau yang kredit konstruksi dan KPR-nya dari bank yang sama,\nkarena pemecahan sertifikatnya lebih mudah. Anda bisa menanyakannya ke bank\npenyalur KPR.&lt;br&gt;\n&lt;br&gt;\nPastikan perumahan sudah memiliki legalitas komplit: izin penguasaan lahan (izin\nlokasi), sertifikat induk berstatus HGB atas nama developer, master plan dan\nsite plan yang sudah disahkan pemerintah setempat, SIPPT, IMB, dan izin\npenggunaan bangunan (IPB) khusus untuk apartemen atau bangunan tinggi. Minta\ndeveloper menunjukkan copy-nya.&lt;br&gt;\n&lt;br&gt;\nAda bank yang demi mengejar target, sertifikat induk belum jadi sudah mau\nmeneken akad kredit. Akibatnya proses pemecahan sertifikat berlarut-larut. &lt;a href=&quot;http://rumahta.com/&quot;&gt;Sebaiknya transaksi rumah dilakukan dengan\nnotaris/PPAT&lt;/a&gt; yang dipakai developer saat membebaskan tanah karena dia\nmengetahui riwayat tanah tersebut.&lt;/p&gt;\n\n&lt;p&gt;18. Serah terima rumah meleset&lt;br&gt;\nMasalah ini terbilang paling banyak diadukan konsumen ke YLKI. Banyak faktor\nyang menyebabkannya. Misalnya, jumlah rumah yang laku belum mencapai skala yang\ncukup ekonomis untuk dibangun, sehingga developer menunda konstruksi. Ini\nbanyak terjadi pada apartemen yang pengembangannya harus sekali jadi dan butuh\nmodal besar.&lt;/p&gt;\n\n&lt;p&gt;Bisa juga &lt;a href=&quot;http://rumahta.com/&quot;&gt;serah terima rumah&lt;/a&gt; meleset karena developer\ngagal mendapat kredit konstruksi. Akibatnya proses pematangan lahan dan\npembangunan infrastruktur perumahan tersendat dan rumah belum bisa dibangun.\nAtau legalitas masih dalam proses, tapi developer sudah memasarkan rumah.\nBegitu proses perizinan bermasalah, pembangunan rumah pun tertunda.&lt;/p&gt;', '2013-03-20', 1, 'resapan_air-rumahta.com__thumb.jpg', 'resapan_air-rumahta.com_.jpg'),
(20, 'Mengukur Efektifitas Promosi Rumah di Makassar', '&lt;p&gt;Di sebuah proyek yang pernah di\nkagumi karena ratio antara LEAD (prospek) dan CLOSING adalah 5:1, tiba-tiba\npenjualan selama 2 bulan ngedrop drastis. Biasanya jualan 2 digit (&amp;gt; 10\nunit) perbulan, tiba tiba cuma 4 unit per bulan. &lt;br&gt;\n&lt;br&gt;\nYang saya maksud rasio Lead dan Closing 5:1 artinya dari 5 prospek yang dicatat\ndi Buku Prospek, akan terjadi 1 closing. Ini rasio yang bagus. Karena &lt;a href=&quot;http://rumahta.com/&quot;&gt;normalnya dalam promosi rumah&lt;/a&gt; adalah 20:1.&lt;br&gt;\n&lt;br&gt;\nMenyikapi hal ini, dalam Buku Prospek dan melihat jumlah lead yang dicatat\ndisana. Wah, ternyata dalam 2 bulan tersebut angka lead hanya tercatat hanya 21\ndan 18. Pantas jumlah closing cuma 4 unit per bulan. Padahal bulan bulan\nsebelumnya rata-rata jumlah lead kisaran 70 orang. &lt;br&gt;\n&lt;br&gt;\nDari analisa taktik Product, Price, Place tak ada perubahan signifikan. Begitu\nmelihat &lt;a href=&quot;http://rumahta.com/&quot;&gt;strategi promosi&lt;/a&gt; yang tertuju pada\nselling point iklan dengan ditulis seperti ini;&lt;br&gt;\n&lt;br&gt;\nLOKASI BERKELAS, TIDAK PANAS, HARGA PANTAS. MULAI 152 JUTAAN. &lt;br&gt;\n&lt;br&gt;\nHarga sudah include PPN.&lt;br&gt;\n&lt;br&gt;\nBila dihitung harga jual sebelum PPN, ketemu di angka 139 jutaan.&lt;br&gt;\n&lt;br&gt;\nDengan didasari rasio lead : closing yang bagus di proyek tersebut sebelumnya, Rumahta.com\nmengusulkan agar materi iklan di Rumahta.com diubah menjadi:&lt;br&gt;\n&lt;br&gt;\nLOKASI STRATEGIS, LINGKUNGAN BERKELAS, HARGA HANYA 130 JUTAAN.&lt;br&gt;\n&lt;br&gt;\nMemilih menyebut harga jual sebelum PPN.&lt;br&gt;\nTulis saja dengan menyebut harga 139 juta dengan kalimat ''130 jutaan''.&lt;br&gt;\n&lt;br&gt;\nTujuan utama cuma 1; banyak customer yang menelpon dan datang ke lokasi. Dan\nitu masuk daftar prospek. Jumlah lead besar, potensi closing besar. Dan selama\nini proyek tersebut bisa diandalkan. Rekaman di Buku Prospek membuktikan rasio\nLead : Closing adalah 5:1.&lt;br&gt;\n&lt;br&gt;\nAnda boleh berpikir ini hal sepele. Tapi boleh percaya boleh tidak, dengan\nkonsep iklan tersebut, rumah Anda bisa bisa jadi daya tarik pembeli. &lt;br&gt;\n&lt;br&gt;\nPelajaran yang bisa diambil;&lt;br&gt;\nLakukan analisa efektifitas beriklan dengan membuat Buku Prospek. Buku prospek\nuntuk mengetahui berapa lead yang kita peroleh dari hasil beriklan. Dan\nkemudian berapa rasio antara lead dengan closing. Kadangkala pemahaman mengenai\nrasio tersebut membantu kita mengambil keputusan dalam &lt;a href=&quot;http://rumahta.com/&quot;&gt;taktik pemasaran rumah di Makassar&lt;/a&gt;.&lt;br&gt;\n&lt;br&gt;\nSukses untuk kita semua.&lt;/p&gt;', '2013-03-20', 1, 'promosi_rumahta.com__thumb.jpg', 'promosi_rumahta.com_.jpg');
