(21, 'Cara Mudah Mengurus IMB di Makassar', '&lt;p&gt;Dalam\nartikel ini kami admin &lt;strong&gt;&lt;span&gt;Rumahta.Com&lt;/span&gt;&lt;/strong&gt;\ndijelaskan mengenai tips, saran dan penjelasan singkat mengenai &lt;a href=&quot;http://rumahta.com/&quot;&gt;mengurus IMB di Makassar&lt;/a&gt;. Bagi anda yang ingin\nmengurus sediri IMB tanpa &lt;strong&gt;bantuan jasa&lt;/strong&gt; mungkin\npenjelasan ini sangat membantu :&lt;/p&gt;\n\n&lt;p&gt;1.\nMengambil formulir di Dinas Perkerjaan Umum Kota Makassar,&lt;/p&gt;\n\n&lt;p&gt;2.\nFormulir diisi dan ditandatangani di atas materai 6000 oleh pemohon,&lt;/p&gt;\n\n&lt;p&gt;3.&amp;nbsp;\nFormulir dilegalisir kelurahan dan kecamatan dimana bangunan akan didirikan,&lt;/p&gt;\n\n&lt;p&gt;4.\nLampiran-lampiran yang diperlukan masing-masing 3 rangkap adalah :&lt;/p&gt;\n\n&lt;p&gt;a.&amp;nbsp;\nGambar denah, tampak (minimal 2 gambar), potongan (minimal 2 gambar), rencana\npondasi, rencana atap, rencana sanitasi serta site plan. Lihat &lt;strong&gt;&lt;span&gt;contoh gambar pra rencana,&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;b.&amp;nbsp;\nGambar konstruksi beton serta perhitungannya,&lt;/p&gt;\n\n&lt;p&gt;c. Gambar\nkonstruksi baja serta perhitungannya,&lt;/p&gt;\n\n&lt;p&gt;d. Hasil\npenyelidikan tanah serta uji laboratorium mekanika tanah untuk bangunan\nberlantai 2 atau lebih,&lt;/p&gt;\n\n&lt;p&gt;e. Surat\nketerangan kepemilikan tanah/sertifikat HM (Hak Milik)/HGB (Hak Guna Bangunan),&lt;/p&gt;\n\n&lt;p&gt;f. Surat\npersetujuan tetangga, untuk bangunan berhimpit&amp;nbsp;dengan batas&amp;nbsp;persil,&lt;/p&gt;\n\n&lt;p&gt;g. Surat\nkerelaan tanah bermaterai Rp.6000 dari pemilik tanah yang diketahui oleh Lurah\nserta camat, apabila tanah bukan milik pemohon,&lt;/p&gt;\n\n&lt;p&gt;h. Surat\nPerintah Kerja (SPK) apabila pekerjaan diborongkan,&lt;/p&gt;\n\n&lt;p&gt;i. Ada\nizin usaha (HO) untuk &lt;strong&gt;&lt;span&gt;bangunan komersial,&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;j. Ada\nizin prinsip dari pejabat Kepala Daerah kota Makassar bila lokasi bangunan\nmenyimpang dari Tata Ruang Kota.&lt;/p&gt;\n\n&lt;p&gt;5.\nFormulir yang telah diisi beserta lampiran-lampirannya diserahkan ke DPU.&lt;/p&gt;\n\n&lt;p&gt;6. Pemohon\n(yang mengurus imb) akan diberitahu apakah &lt;a href=&quot;http://rumahta.com/&quot;&gt;permohonan\nizin bangunan disetujui atau tidak&lt;/a&gt;.&lt;/p&gt;', '2013-03-20', 1, 'imb-rumahta.com_3_thumb.jpg', 'imb-rumahta.com_3.jpg'),
(22, 'Tips membuat judul  iklan properti yang efektif di Rumahta.com', 'Agar iklan Anda mudah di ketemukan\noleh para pencari iklan di seluruh Indonesia bahkan dunia melalui Rumahta.com,\nada beberapa trik yang perlu di perhatikan, kebanyakan masyarakat mencari rumah\ndijual atau disewakan menggunakan mesin pencari seperti google, yahoo, dll,\ndengan menggunakan kata kunci yang mirip judul iklan Anda nantinya.&lt;br&gt;\n&lt;br&gt;\nNah dengan manfaatkan judul iklan Anda untuk mempertemukan kata kunci para\npencari iklan:&lt;ol&gt;&lt;li&gt;\n\nGunakan judul yang pendek,\n     maks. 5 suku kata,&lt;/li&gt;&lt;li&gt;Gunakan kata-kata seperti Rumah\n     ...., &lt;i&gt;Tipe rumah dan kawasan atau daerah rumah Anda yang akan\n     dijual/disewakan&lt;/i&gt;,&lt;/li&gt;&lt;li&gt;Letakkan nama kota seperti &lt;i&gt;di\n     Makassar&lt;/i&gt; atau &lt;i&gt;didaerah wilayah Sulawesi Selatan&lt;/i&gt;, pada bagian\n     akhir judul,&lt;/li&gt;&lt;li&gt;Contoh judul yang kurang baik: &Atilde;&cent;??&lt;i&gt;Rumah di perumahan.....&lt;/i&gt;&Atilde;&cent;?? jangan\n     gunakan &lt;i&gt;Nama perumahan yang Anda jual&lt;/i&gt;,&amp;nbsp; sebaiknya judul di\n     rubah menjadi, misal: &lt;b&gt;&lt;a href=&quot;http://rumahta.com&quot; target=&quot;&quot;&gt;Rumah murah type 36 di Mamminasata Makassar&lt;/a&gt;&lt;/b&gt;.\n\n&lt;/li&gt;&lt;/ol&gt;&lt;br&gt;Dengan menggunakan struktur judul di atas maka iklan Anda akan sesuai\ndengan kata kunci para pencari iklan Anda.&lt;br&gt;\n&amp;nbsp;&lt;br&gt;\nSatu lagi yang tak kalah penting, setelah membuat iklan jangan lupa klik share\nuntuk di bagikan ke jejaring &lt;a href=&quot;http://rumahta.com&quot;&gt;&lt;span&gt;sosial seperti facebook dan twitter&lt;/span&gt;&lt;/a&gt;&amp;nbsp; yang\ntelah tersedia dibagian atas detail listing Anda.&lt;br&gt;\n&amp;nbsp;&lt;br&gt;\nSelamat beriklan...', '2013-05-08', 1, 'judul_thumb.jpg', 'judul.jpg'),
(27, 'Lima Cara China Kendalikan Laju Properti', '&lt;strong&gt;KOMPAS.com - &lt;/strong&gt;Belajarlah hingga ke Negeri China. \nPepatah ini boleh jadi relevan diterapkan pada kondisi aktual. Mengingat\n sektor properti Indonesia tengah dalam laju pertumbuhan yang sangat \npesat sehingga menimbulkan kekhawatiran &quot;bubble&quot;.China, terutama \nkota utamanya Beijing, memang sudah memberlakukan kebijakan pembatasan \nketat atas kepemilikan real estat sejak Maret lalu. Namun, itu saja \nbelum cukup. Mereka dipaksa mengambil langkah-langkah tambahan guna \nmempertahankan harga dan pertumbuhan properti pada batas kewajaran. \nPembatasan tersebut dilakukan agar harga properti, khususnya perumahan, \nterjangkau oleh masyarakat.&lt;span&gt; Sebagai informasi, harga rumah baru di Beijing pada April lalu naik 3,1 persen dari bulan sebelumnya.&lt;br&gt;&lt;br&gt;&quot;Sebagai ibukota Cina, dan kota yang telah memberlakukan pembatasan properti, Beijing berada di bawah banyak tekanan karena masih memimpin kenaikan harga. Sebaliknya, jika pengawasan terlalu ketat juga akan berdampak pada pertumbuhan,&quot; kata Luo Yu, analis Shanghai CEBM Group seperti dikutip dalam reportase Zang Dingmin.&lt;/span&gt;&lt;span&gt;Kenaikan harga rumah baru pada bulan April tersebut merupakan&amp;nbsp;terbesar sejak penurunan pada bulan November 2012. Padahal, mereka sebelumnya telah meningkatkan&amp;nbsp;uang muka KPR minimal untuk rumah kedua menjadi 70 persen dan melarang rumah tangga tunggal membeli lebih dari satu rumah tinggal, sebagai bentuk melawan dinamika harga.&lt;/span&gt;&lt;span&gt;Selain kebijakan pengetatan, Beijing juga melakukan langkah-langkah yang berdampak strategis berikut:&lt;/span&gt;&lt;strong&gt;&lt;span&gt;&lt;br&gt;&lt;br&gt;1. Menolak ijin pra penjualan proyek baru&lt;/span&gt;&lt;/strong&gt;&lt;span&gt;Beijing\n yang merupakan kota ketiga paling padat penduduknya, 16,9 juta jiwa, \nadalah satu-satunya  kota yang memaksa pembatasan harga dengan \nsungguh-sungguh. Mereka menolak izin pra penjualan untuk beberapa proyek yang dinilai terlalu mahal. &lt;/span&gt;&lt;strong&gt;&lt;span&gt;&lt;br&gt;&lt;br&gt;2. Mengekang praktik spekulasi&lt;/span&gt;&lt;/strong&gt;&lt;span&gt;Setelah\n harga rumah melonjak tinggi dalam dua tahun terakhir, Beijing \nterstimulasi meredam lonjakan tersebut dengan mengekang praktik \nspekulasi. Caranya menaikkan uang muka rumah kedua dari 60 persen \nmenjadi 70 persen dan mengenakan pajak sebesar 20 persen atas transaksi \nrumah kedua.&lt;/span&gt;&lt;strong&gt;&lt;br&gt;&lt;br&gt;3. Menolak persetujuan kenaikan harga&lt;/strong&gt;&lt;span&gt;Kebijakan\n ini dinilai &quot;aneh&quot; oleh para pengembang. Sehingga mereka  menemukan \nkesulitan untuk mendapatkan persetujuan atas kenaikan harga 5  persen, \ndan hampir mustahil untuk kenaikan 10 persen&lt;/span&gt;.&lt;strong&gt;&lt;br&gt;&lt;br&gt;4. Menyediakan perumahan yang layak dan terjangkau&lt;/strong&gt;Sebagai\n akibat derasnya migrasi urban sehingga meningkatkan populasi penduduk \nperdesaan di Beijing, pemerintah setempat berupaya keras menyediakan \nperumahan bagi mereka. bukan sembarang hunian, melainkan di pusat kota \ndengan kondisi layak dan harga terjangkau. Di tengah kelangkaan pasokan \ndan tingginya harga jual hunian,rata-rata naik 27.349 yuan per meter \npersegi (Rp 43,23 juta), Beijing mengambil alih lahan yang dikuasai \nswasta namun tidak dimanfaatkan.&lt;strong&gt;&lt;br&gt;&lt;br&gt;5. Mendorong kembali pembangunan yang tertunda&lt;/strong&gt;&lt;span&gt;Beijing\n membuka kembali pengembangan skala kota terintegrasi yang tertunda. \nPengembangan di wilayah strategis Beijing yang dilakukan, salah satunya,\n oleh Sunac berisi hunian yang dibangun dalam beberapa tahap. Mereka \njuga meninjau kerjasama dengan beberapa pengembang besar &lt;/span&gt;lainnya.&lt;i&gt;&lt;br&gt;&lt;br&gt;&lt;/i&gt;&lt;i&gt;China punya cara sendiri mengekang laju pertumbuhan harga propertinya dengan membatasi praktik spekulasi. &lt;br&gt;&lt;br&gt;&lt;/i&gt;&lt;i&gt;(&lt;/i&gt;&lt;a href=&quot;http://properti.kompas.com/index.php/read/2013/06/04/14060156/Lima.Cara.China.Kendalikan.Laju.Properti.&quot; target=&quot;_blank&quot;&gt;Kompas.com&lt;/a&gt;&lt;i&gt;)&lt;br&gt;&lt;/i&gt;', '2013-06-04', 1, 'foto_31_thumb.jpg', 'foto_31.jpg'),
(23, 'Tips Membeli Rumah Di kawasan Mamminasata', 'Setiap orang pasti menginginkan punya\nrumah sendiri. Dan pilihan tepat saat ini adalah membeli rumah di lokasi\nperumahan. Ini karena setiap pengembang perumahan berlomba memberikan tawaran ''konsep'' penataan lingkungan yang baik, desain rumah yang ciamik plus\ntersedianya segenap fasilitas baik itu sarana maupun prasarana bagi Anda. Anda\nmenjadi termanjakan akan iming-iming tersebut sehingga berfikir membangun rumah\ndi lahan kosong pada lingkungan biasa menjadi pilihan kesekian. Selain itu,\nmembeli rumah pada pengembang memiliki cara pembayaran yang ringan dibanding\njika harus membangun rumah sendiri dari awal sampai akhir.&lt;br&gt;\n&lt;br&gt;\nApakah Anda punya alasan lainnya lagi ?&lt;br&gt;\n&lt;br&gt;\nTapi perlu diingat, karena rumah akan menjadi tempat\ntinggal Anda selamanya, maka membeli rumah harus dilakukan dengan cara\nbijaksana. Sebaiknya jangan dilakukan terburu-buru hanya karena tergiur promosi\nyang tergambar di brosur. Selidiki dahulu, tujuannya agar rumah sebagai\ninvestasi masa depan betul-betul memiliki nilai yang maksimal.\n\nUntuk mencari hunian dikawasan\nMamminasata atau kawasan lainnya. Anda dapat menjadikan Rumahta.com sebagai\nwadah pencarian &lt;a href=&quot;http://rumahta.com/&quot;&gt;hunian yang nyaman bagi keluarga\nAnda&lt;/a&gt;.&lt;br&gt;\n&lt;br&gt;\nAda 5 hal pokok sebagai cara bijaksana dalam membeli rumah\nyang ''tepat'' dari pengembang, yaitu ;&lt;br&gt;&lt;br&gt;&lt;ol&gt;&lt;li&gt;\n\nMengetahui\n     bahwa lokasi perumahan yang Anda incar berada di lokasi strategis, salah\n     satunya kawasan Mamminasata.&lt;br&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Mengetahui\n     bahwa pengembang memiliki kredibilitas dan reputasi yang baik.&lt;br&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Mengetahui\n     bahwa perumahan memiliki konsep tata lingkungan dan tema yang jelas.&lt;br&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Mengetahui\n     kualitas rumah dari spesifikasi yang ditawarkan dan metode pelaksanaannya.&lt;br&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Mengetahui tentang\nbank pemberi KPR.&lt;br&gt;&lt;/li&gt;&lt;/ol&gt;\n&lt;br&gt;\nSelain 5 hal diatas, ada hal lain lagi\nyang tak kalah penting yang perlu menjadi pertimbangan bagi Anda, yakni soal\nHARGA !. &lt;br&gt;\n&lt;br&gt;\nMeskipun ''harga'' sifatnya relative sekali tergantung pola\nfikir dan kemampuan masing-masing, tak urung ''harga'' selalu dapat mempengaruhi\nakan jatuhnya sebuah pilihan.&lt;br&gt;\n&lt;br&gt;\nKhusus mengenai harga, saran saya agar penilaian mahal\natau murahnya sebuah ''harga rumah'' harus terlebih dahulu melalui pertimbangan\nterhadap 5 hal pokok diatas sehingga keputusan yang Anda buat menjadi objektif.\nJangan sampai jebakan ''harga'' yang murah tanpa mempertimbangkan sisi strategis\nlainnya malah membuat Anda menyesal setelah membeli rumah tersebut.&lt;br&gt;\n&lt;br&gt;\nLakukan perbandingan harga pada perumahan di wilayah yang\nsama yang setidaknya memiliki spesifikasi teknis yang hampir sama agar\npenilaian terhadap harga rumah menjadi objektif. Lakukan pula pengecekan apakah\nharga tersebut sudah termasuk HGB, IMB, pajak, atau biaya lainnya yang akan\ntimbul sampai proses akad kredit di bank selesai.&lt;br&gt;\n&lt;br&gt;\n&lt;br&gt;\nSemoga bermanfaat', '2013-04-13', 1, 'mamminasata_rumahta.com__thumb.jpg', 'mamminasata_rumahta.com_.jpg'),
(24, 'Tips Memilih Lokasi Perumahan di Makassar dan sekitarnya', '&lt;p&gt;Pada postingan\nsebelumnya tentang &lt;a href=&quot;http://rumahta.com/page/news_detail/23/Tips-Membeli-Rumah-Di-kawasan-Mamminasata&quot;&gt;TIPS\nMEMBELI RUMAH DI KAWASAN MAMMINASATA&lt;/a&gt;, telah saya uraikan hal pokok yang\ndapat menjadi acuan bagi anda sebelum memutuskan memilih perumahan yang\ndiinginkan. Maka kali ini saya coba menguraikannya lebih detail lagi satu\npersatu sehingga saya berharap pengetahuan anda bertambah. &lt;br&gt;\n&lt;br&gt;\nKali ini kita akan coba bahas tentang tips memilih lokasi\nperumahan yang strategis. Mendapatkan rumah di lokasi yang strategis tentu\nsangat menguntungkan, selain menyangkut soal aksesibilitas, keamanan,\nkenyamanan juga akan menambah nilai jual rumah tersebut.&lt;br&gt;\n&lt;br&gt;\nJadi, lokasi perumahan yang strategis memiliki arti bahwa\nlokasi tersebut tidak hanya memiliki &acirc;??value&acirc;?? atau nilai untuk kepentingan\njangka pendek saja tetapi juga memiliki nilai keuntungan jangka panjang.&lt;br&gt;\n&lt;br&gt;\nNilai strategis lokasi perumahan dapat diukur dengan\nketentuan berikut ini ; &lt;br&gt;\n&lt;br&gt;&lt;/p&gt;&lt;ol&gt;&lt;li&gt;\nLokasi perumahan tidak termasuk dalam criteria yang\ndilarang oleh pemerintah untuk dibangun atau yang dapat merugikan anda, yaitu ;&lt;br&gt;&lt;ul&gt;&lt;li&gt;\nBerada di kawasan bebas bangunan pada area bandara.&lt;/li&gt;&lt;li&gt;Berada di kawasan dibawah jaringan listrik tegangan\ntinggi SUTT/SUTET (Saluran Udara Tegangan Ekstra Tinggi sebesar 500 kV).&lt;/li&gt;&lt;li&gt;Berada di kawasan kawasan lindung.&lt;/li&gt;&lt;li&gt;Berada di kawasan olahan pertanian.&lt;/li&gt;&lt;li&gt;Berada di kawasan hutan produksi.&lt;/li&gt;&lt;li&gt;Berada di kawasan daerah buangan limbah pabrik.&lt;/li&gt;&lt;li&gt;Berada di kawasan yang mempunyai pencemaran udara di\natas ambang batas, pencemaran air permukaan dan air tanah dalam.&lt;/li&gt;&lt;/ul&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Lokasi perumahan hendaknya dipilih yang termasuk dalam\nRencana Tata Ruang Wilayah (RTRW) atau Rencana Umum Tata Ruang Kota (RUTRK) perihal\nperuntukan lahan.&lt;br&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Status kepemilikan lahan harus jelas legalitas dan\nriwayatnya, ditinjau dari persyaratan administrative dan teknis.&lt;br&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Lokasi perumahan berada di kawasan bebas banjir dengan\nsystem drainase kawasan yang tertata dan terencana dengan baik.&lt;br&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Lokasi perumahan memilki nilai NJOP (Nilai Jual Objek\nPajak) yang diprediksi akan naik signifikan dalam tahun mendatang.&lt;br&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Lokasi perumahan memiliki potensi untuk berkembang dan\nproduktif.&lt;/li&gt;&lt;li&gt;Lokasi perumahan dekat dengan layanan public seperti\nrumah sakit, sekolah, pasar/mal dll.&lt;br&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Lokasi perumahan dekat dengan layanan pemerintahan.&lt;br&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Lokasi perumahan dekat dengan sarana transportasi umum.&lt;br&gt;&lt;br&gt;&lt;/li&gt;&lt;li&gt;Kawasan di lokasi perumahan memiliki prasarana jalan,\nlistrik, telpon, air bersih yang memadai.&lt;br&gt;&lt;/li&gt;&lt;/ol&gt;&lt;p&gt;\n&lt;br&gt;\n&lt;br&gt;\nSemoga bermanfaat&lt;/p&gt;', '2013-04-13', 1, 'perumahan_rumahta.com__thumb.jpg', 'perumahan_rumahta.com_.jpg'),
(25, 'Teori Lokasi Kawasan Perumahan di Sulawesi Selatan', 'Luhst (1997) menyebutkan bahwa kualitas kehidupan yang berupa kenyamanan,\nkeamanan dari suatu rumah tinggal sangat ditentukan oleh lokasinya, dalam arti\ndaya tarik dari suatu lokasi ditentukan oleh dua hal yaitu lingkungan dan\naksesibilitas. \n&lt;br&gt;&lt;br&gt;Lingkungan\noleh Luhst didefenisikan sebagai suatu wilayah yang secara geografis dibatasi\ndengan batas nyata, dan&amp;nbsp; biasanya dihuni oleh kelompok penduduk.\nLingkungan mengandung unsur-unsur fisik dan sosial yang menimbulkan kegiatan\ndan kesibukan dalam kehidupan sehari-hari. Unsur-unsur tersebut berupa gedung-gedung\nsekolah, bangunan pertokoan, pasar, daerah terbuka untuk rekreasi, jalan mobil\ndan sebagainya.\n&lt;br&gt;&lt;br&gt;Aksesibilitas\nmerupakan daya tarik suatu lokasi dikarenakan akan memperoleh kemudahan dalam\npencapaiannya dari berbagai pusat kegiatan seperti pusat perdagangan, pusat\npendidikan, daerah industri, jasa pelayanan perbankan, tempat rekreasi,\npelayanan pemerintahan, jasa profesional dan bahkan merupakan perpaduan antara\nsemua kegiatan tersebut. Penilaian dari aksesibilitas bisa berupa jarak dari\nCentral Business Distrik atau CBD, kemudahan mendapat pelayanan dari\ntransportasi umum yang menuju lokasi bersangkutan atau bisa juga dilihat dari\nlebar jalan yaitu semakin sempit lebar jalan suatu lahan, maka berarti\naksesibilitas dari tempat yang bersangkutan kurang baik.&amp;nbsp; &lt;br&gt;&lt;br&gt;\nPertimbangan\nlain yang sangat menentukan pemilihan lokasi perumahan adalah nilai tanah,\nseperti diungkapkan oleh Richard M Hurds dalam Haikal Ali (1996) dengan teori\nBid-rent yang menyatakan bahwa nilai lahan sangat tergantung pada kemauan dan\nkemampuan untuk membayar karena faktor ekonomi dan keinginan tinggal di lokasi\ndan kedekatan. \n&lt;br&gt;&lt;br&gt;Teori ini\nmuncul karena semakin mahalnya harga lahan di perkotaan, untuk mendapatkan\nharga lahan yang murah maka penduduk bergerak kearah pinggiran kota.&amp;nbsp;\nDengan kata lain seamakin jauh lokasinya dari pusat kota, semakin menurun\npermintaan akan tanah. Dan apabila tanah banyak, maka sewa yang ditawarkan\norang untuk membayar tanah per meter bujur sangkarnya menurun mengikuti\njaraknya dari pusat kota. Dengan demikian tanah dipinggiran luar kota,\npersaingannya berkurang dan harga yang ditawarkan untuk tanah perumahan lebih\ntinggi harganya dibandingkan tanah tersebut ditawarkan untuk pendirian toko,\nkarena tanah dipinggiran kota lebih banyak diperuntukan bagi perumahan.\n&lt;br&gt;&lt;br&gt;Berry dan\nHarton dalam Nasucha (1995) menjelaskan hubungan antara harga tanah dengan\npencapaian atau aksesibilitas yang diukur dengan jarak dari pusat kota.\nPencapaian atau akses akan semakin menurun secara bertahap kesemua arah dari\npusat kota, sehingga harga tanah akan semakin berkurang seiring dengan makin\njauhnya lokasi tersebut terhadap pusat kota. Tanah yang berada di sepanjang\njalan utama harga sewanya akan lebih tinggi dibandingkan dengan harga sewa\ntanah yang tidak berada di jalan utama.\n&lt;br&gt;&lt;br&gt;Goodall\n(1972) menyebutkan bahwa beberapa pertimbangan yang dilakukan oleh suatu\nkeluarga dalam memilih sebuah rumah yaitu :\n\n&lt;br&gt;a)&amp;nbsp; suasana kehidupan di lingkungan.\n\n&lt;br&gt;b)&amp;nbsp; lokasi perumahan.&lt;br&gt;c)&amp;nbsp; keadaan fisik rumah.&lt;br&gt;d)&amp;nbsp; kelengkapan fasilitas rumah.&lt;br&gt;e)&amp;nbsp; nilai prestisius.&lt;br&gt;f)&amp;nbsp; harga rumah.&lt;br&gt;g)&amp;nbsp; pendapatan keluarga.\n&lt;br&gt;&lt;br&gt;Suharsono (Wonosuprojo dkk, 1995) mengemukakan yang perlu diperhatikan dalam menentukan\nlokasi permukiman dari sudut geomorfologi adalah :\n\n&lt;br&gt;a)&amp;nbsp; relief, meliputi kemiringan dan besar sudut lereng,\n\n&lt;br&gt;b)&amp;nbsp; tanah, meliputi daya dukung tanah dan tekstur,\n\n&lt;br&gt;c)&amp;nbsp; proses geomorfologi, meliputi tingkat erosi,\nkenampakan gerakan masa kedalam saluran dan kerapatan&amp;nbsp; aliran.\n\n&lt;br&gt;d)&amp;nbsp; batuan, meliputi tingkat kelapukan batuan dan kekuatan\nbatuan,\n&lt;br&gt;\ne)&amp;nbsp; hidrologi, meliputi kedalaman air tanah pada sumur\ngali,\n\n&lt;br&gt;f)&amp;nbsp; klimatologi, meliputi curah hujan,\nsuhu udara, kelembaban udara relatif, kecepatan dan arah mata angin,\n\n&lt;br&gt;g)&amp;nbsp; penggunaan lahan,\n\n&lt;br&gt;h)&amp;nbsp; jaringanan jalan dan jembatan, saluran pembuangan\nlimbah, dan drainase,\n&lt;br&gt;\ni)&amp;nbsp; kependudukan dan sosial ekonomi.\n&lt;br&gt;&lt;br&gt;Prayogo\nMirhard (Wonosuprojo dkk, 1993) membahas tentang pengadaan perumahan bagi\nberbagai tingkat pendapatan dan penentuan lokasi permukiman yang baik perlu\nmemperhatikan hal-hal sebagai berikut :\n\n&lt;b&gt;&lt;br&gt;&lt;br&gt;a)&lt;/b&gt;&amp;nbsp; &lt;b&gt;Aspek Teknis Pelaksanaan&lt;/b&gt;\n\n&lt;br&gt;1)&amp;nbsp; Mudah mengerjakannya dalam arti tidak banyak pekerjaan\ngali dan urug, pembongkaran tonggak kayu, dan sebagainya.\n\n&lt;br&gt;2)&amp;nbsp; Bukan daerah banjir, gempa, angin ribut, perayapan.\n\n&lt;br&gt;3)&amp;nbsp; Mudah dicapai tanpa hambatan yang berarti.\n\n&lt;br&gt;4)&amp;nbsp; Kondisi tanah baik, sehingga konstruksi bangunan\ndirencanakan semurah mungkin.\n\n&lt;br&gt;5)&amp;nbsp; Mudah mendapat air bersih, listrik, pembuangan air\nlimbah/ kotoran/ hujan\n\n6)&amp;nbsp; Mudah mendapat bahan bangunan.&lt;br&gt;7)&amp;nbsp; Mudah mendapat tenaga kerja.&lt;br&gt;&amp;nbsp;&lt;b&gt;&lt;br&gt;b)&lt;/b&gt;&amp;nbsp; &lt;b&gt;Aspek Tata Guna Tanah&lt;/b&gt;\n\n&lt;br&gt;1)&amp;nbsp; Tanah secara ekonomis lebih sukar dikembangkan secara\nproduktif.&lt;br&gt;2)&amp;nbsp; Tidak merusak lingkungan yang telah ada, bahkan kalau\ndapat memperbaikinya.&lt;br&gt;3)&amp;nbsp; Sejauh mungkin mempertahankan fungsi sebagai reservoir\nair tanah,dan penampung air hujan.\n&lt;b&gt;&lt;br&gt;&lt;br&gt;c)&lt;/b&gt;&amp;nbsp; &lt;b&gt;Aspek Kesehatan&lt;/b&gt;\n\n&lt;br&gt;1)&amp;nbsp; Lokasi sebaiknya jauh dari lokasi pabrik yang dapat\nmendatangkan polusi.\n\n2)&amp;nbsp; Lokasi sebaiknya tidak terlalu terganggu kebisingan.&lt;br&gt;3)&amp;nbsp; Lokasi sebaiknya dipilih yang mudah untuk mendapatkan\nair minum, listrik, sekolah, puskesmas dan lainnya untuk kepentingan keluarga.&lt;br&gt;4)&amp;nbsp; Lokasi sebaiknya mudah dicapai dari tempat kerja\npenghuni.&lt;br&gt;&lt;br&gt;&lt;b&gt;d)&lt;/b&gt;&amp;nbsp; &lt;b&gt;Aspek Politik Ekonomis&lt;/b&gt;\n\n&lt;br&gt;1)&amp;nbsp; Menciptakan kesempatan kerja dan berusaha bagi\nmasyarakat sekitarnya.\n\n&lt;br&gt;2)&amp;nbsp; Dapat merupakan suatu contoh bagi masyarakat disekitarnya\nuntuk membangun rumah dan lingkungan yang sehat.&lt;br&gt;3)&amp;nbsp; Mudah menjualnya karena lokasinya disukai oleh calon\npembeli dan mendapat keuntungan yang wajar.\n&lt;br&gt;&lt;br&gt;&lt;br&gt;Dasra (1995)\nmengatakan bahwa faktor-faktor dominan dalam penentuan lokasi perumahan adalah\n:\n\n&lt;br&gt;a)&amp;nbsp; Arah perkembangan kota, dengan faktor penentu adalah\nkeadaan fisik kota (seperti adanya sungai, topografi tanak dsb).&lt;br&gt;b)&amp;nbsp; Ketersediaan lahan dan harga tanah\n\nTersedianya lahan yang belum terbangun, semakin mahal\nharga tanah maka biaya unit satuan perumahan akan semakin tinggi.\n\n&lt;br&gt;c)&amp;nbsp; Kondisi sosial budaya\n\nKecenderungan perkembangan penduduk (kepadatan, jumlah\ndan pertumbuhan penduduk) menentukan kebutuhan akan rumah. \n\n&lt;br&gt;d)&amp;nbsp; Aksesibilitas\n\nTersedianya sarana transportasi, baik skala lokal\nmaupun regional. &lt;br&gt;\n\ne)&amp;nbsp; Transportasi dan utilitas.&lt;br&gt;&lt;br&gt;&amp;nbsp;&lt;br&gt;Tersedianya pola jaringan jalan, jariingan listrik,\njaringan telepon, jaringan drainase serta jaringan air bersih.\n&lt;br&gt;&lt;br&gt;Koestoer\n(1997) lebih menekankan pada faktor aksesibilitas sebagai pengaruh utama dalam\nmemilih lokasi tempat tinggal yaitu kemudahan transportasi dan kedekatan jarak.\nKoestoer berpendapat bahwa terdapat hubungan yang sangat erat antara\nketersediaan angkutan umum lokal dengan pertumbuhan lokasi tempat tinggal,\nadanya pelayanan angkutan umum menyebabkan kemudahan dalam mencapai lokasi\ntempat tinggal yang berada di daerah pinggiran kota, sehingga semakin baik\npelayanan transportasi akan mempengaruhi pertumbuhan suatu lingkungan\npermukiman.\n&lt;br&gt;&lt;br&gt;Yeri (2004)\nmengatakan faktor lokasi menjadi pertimbangan penting dalam pemilihan\nperumahan. Faktor lain yang dipertimbangkan oleh konsumen adalah aspek\nlingkungan, fisik rumah, fungsi rumah dan kedekatan dengan berbagai fasilitas\nperkotaan lainnya. Selain itu kondisi lingkungan yang asri, udara segar,\nketersediaan air bersih, kenyamanan dan kondisi lingkungan yang aman akan\nmenajdi pertimbangan konsumen.\n&lt;b&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;Daftar\nPustaka:&lt;/b&gt;\n\n&lt;br&gt;Asteriani, Febby (2005). &quot;Analisis\nPeringkat Faktor-Faktor Pemilihan Lokasi Ruko Dari Sudut Pandang Pengguna dan\nPengembang Ruko Di Kota Pekanbaru&quot;. Tesis S-2 MPKD, UGM, Yogyakarta.\n&lt;br&gt;&lt;br&gt;Haikal Ali,(1996). &quot;Kajian\nKebijaksanaan Pemerintah Kota Administratif Klaten Dalam Penentuan Lokasi\nPerumahan&quot;. Tesis S-2 MPKD, UGM, Yogyakarta.\n&lt;br&gt;&lt;br&gt;Nasucha,Chaizi.(1995). &lt;i&gt;Politik\nEkonomi Pertanahan dan Struktur Perpajakan Atas Tanah&lt;/i&gt;. Kesaint Blanc,\nJakarta.\n\nKoestoer, (2001). &lt;i&gt;Tapak Keruangan\nPerkotaan&lt;/i&gt;. UI Press, Jakarta.\nLuhst,K.M.,(1997). &lt;i&gt;Real Estate\nValuation&lt;/i&gt;. Principles Aplication, USA.', '2013-04-13', 1, 'Hubungan_Sewa_Tanah_dengan_Tata_Guna_Lahan_(Berry_dan_Harton)_thumb.jpg', 'Hubungan_Sewa_Tanah_dengan_Tata_Guna_Lahan_(Berry_dan_Harton).jpg'),
(26, 'Ingin Cari Rumah Idaman di Makassar? Gratis !', 'Kayaknya, impian yang sudah hampir pasti dimiliki oleh semua insan manusia di\nbumi yang sudah beranjak dewasa adalah memiliki rumah. Tidak lebay, tapi\ninilah kenyataannya. Everyone needs a home, or, for sure, &lt;em&gt;a place to\ncall home&lt;/em&gt;.\n\n&lt;br&gt;&lt;br&gt;Dulu, orang berpedoman pada iklan di media cetak, radio atau televisi untuk\nmencari informasi penjualan rumah. Kalau beli rumah baru dari real estate, kita\nhanya bisa mengetahui sebagian kecil informasi dari iklan. Selebihnya\nkita harus mencari informasi sendiri ke agen penjualan.&amp;nbsp; Apalagi kalau\ningin beli rumah second, wah .. mesti siap-siap mata jereng memelototi iklan\nbaris di koran, satu demi satu.&amp;nbsp; Itupun hanya sebagian kecil informasi\nyang tersedia. Dan yang pasti, tidak ada gambar/foto rumah di iklan\nbaris.&amp;nbsp; Kita harus menginvestasikan pulsa telepon kita untuk\nmenghubungi beberapa nomer dari pemilik properti yang mungkin menarik perhatian.\n&lt;br&gt;&lt;br&gt;Lambat laun,berkembanglah sistem agen properti yang kantornya sekarang\ntersebar di mana-mana. Kita bisa mendapatkan listing dan informasi yang lebih\nlengkap tentang properti yang kita inginkan di agen properti offline. Kita bisa\nbertanya ke marketing executive agen properti tersebut tentang spesifikasi\nrumah maupun cara pembeliannya. Tetapi, listing agen properti hanya\nterbatas di area tertentu. Kita pun harus meluangkan waktu lebih banyak\nuntuk bisa mengunjungi agen properti tersebut.\n\n&lt;br&gt;&lt;br&gt;Nah, bagaimana jika kita perlu membeli properti idaman kita yang ada di\nMakassar atau di daerah Sulawesi Selatan? Di jaman serba cepat, tak\njarang kita berburu dan bersaing dengan ratusan peminat lainnya yang juga\nmencari properti yang sama dengan harga yang paling ekonomis. Siapa\ncepat, dia dapat. Seharian kita beraktivitas, bekerja, mengurus\npekerjaan, bisnis, atau keluarga. Kita sudah tak sempat memelototi iklan baris\nsatu persatu, apalagi mendatangi kantor agen properti yang mungkin jaraknya\njauh. Bagaimana kita bisa mendapatkan rumah atau properti idaman kita? Kapan\ndan dimanapun kita berada dapat diakses melalui PC, Laptop, Tablet, Smartphone,\nmaupun Hendphone baik itu siang maupun malam!\n\n&lt;br&gt;&lt;br&gt;Sekarang sudah ada situs online yang benar-benar bisa menjawab kebutuhan kita\nakan pencarian rumah yang nyaman dengan cepat. &lt;a href=&quot;http://rumahta.com/&quot; target=&quot;_blank&quot; title=&quot;http://RUMAH123. &quot;&gt;Rumahta.com&lt;/a&gt;\nnama situsnya. Bagi yang belum tahu, &lt;a href=&quot;http://rumahta.com/&quot; target=&quot;_blank&quot; title=&quot;http://RUMAH123. &quot;&gt;Rumahta.com&lt;/a&gt; adalah Media informasi\nproperti online khusus untuk daerah di Sulawesi Selatan. Mau cari&amp;nbsp; rumah, tanah, indekost, apartemen,\nruko/rukan, kios, atau gudang/pabrik yang\ndijual atau yang disewakan? Fasilitas yang bagaimana Anda inginkan? Dan hanya dengan melihat foto-foto yang tersedia Anda sudah dapat membayangkan bentuk dan model properti yang Anda butuhkan ! Semua bisa diakses di situs &lt;a href=&quot;http://rumahta.com/&quot; target=&quot;_blank&quot; title=&quot;http://RUMAH123. &quot;&gt;Rumahta.com&lt;/a&gt;. Tanpa ke lokasi untuk melihat properti tersebut.\n&lt;br&gt;&lt;br&gt;Informasi dengan cepat bisa didapatkan seperti kisaran harga yang lengkap,\ndan dilengkapi foto dan informasi properti yang sangat memadai untuk\npertimbangan Anda.&amp;nbsp; Dengan listing sebanyak itu, yakinlah bahwa &quot;a place\nto call home&quot;.\n\n&lt;br&gt;&lt;br&gt;Tidak perlu kuatir dengan jumlah listing yang melimpah, karena situs ini\nmemiliki sistem pencari yang canggih, komprehensif dan spesifik, sehingga kita\nbisa menghemat waktu menemukan properti sesuai kebutuhan kita, tanpa harus\ndipusingkan dengan informasi yang tidak kita perlukan.&amp;nbsp; Jelas, mau mudah\ncari rumah ya cuma di &lt;a href=&quot;http://rumahta.com/&quot; target=&quot;_blank&quot; title=&quot;http://RUMAH123. &quot;&gt;Rumahta.com&lt;/a&gt;!&lt;br&gt;&lt;br&gt;', '2013-04-24', 1, 'tamplate-PC_rumahta.com__thumb.jpg', 'tamplate-PC_rumahta.com_.jpg'),
(28, 'Lippo Karawaci Investasi Rp.3,5 Triliun di Makassar', 'PT Lippo Karawaci Tbk (Lippo Karawaci) makin serius\n menggarap pasar properti di Makassar. Mulai Januari 2014, pengembang \nproperti nasional ini akan menghadirkan kawasan mixed-use atau \nmultifungsi di lahan eks PMCC Jalan Boulevard.&lt;br&gt;\n&lt;br&gt;\nKawasan yang dinamai St. Moritz\n Makassar itu akan dibangun di lahan seluas 2,7 hektare dengan nilai \ninvestasi Rp.3,5 triliun. Kawasan tersebut akan menghadirkan hotel dan apartemen, mal, sekolah, rumah sakit, big screen Cineplex of 10 theatres serta helikopter service. &lt;br&gt;\n&lt;br&gt;\nCEO Lippo Homes-Lippo \nKarawaci, Ivan Setiawan Budiono mengatakan St. Moritz Makassar merupakan\n kawasan terpadu yang sesuai dengan gaya hidup modern. Proyek ini \nmenyusul kesuksesan pembangunan Kemang Village dan The St. Moritz \nPenthouse &amp;amp; Residence I Jakarta, ujar Ivan saat jumpa pers di \nSwiss-belinn Hotel, Senin 11 November. &lt;br&gt;\n&lt;br&gt;\nProduct Manager St. Moritz \nMakassar, Tenri Awaru Putri Soekarno mengatakan proyek ini mendukung \nterbentuknya return bagi investor yang ingin bergabung. &lt;br&gt;\n&lt;br&gt;\nPenjualan kawasan ini dimulai dengan tahap pre launching. Yakni masa November hingga awal Desember untuk tipe one bad. &lt;br&gt;\n&lt;br&gt;\nGround breaking direncanakan awal Januari 2014, dan diproyeksi seluruh perencanaan akan selesai dalam empat tahun pengerjaan. &lt;br&gt;\n&lt;br&gt;\nPada proyek ini kita mau buat ikon, berupa tower apartement yang \ntingginya sekira 200 meter. Tower pertama terdiri dari mal 5-6 lantai. \nHotel 10 lantai dan apartement 28 lantai. Hingga total seluruh \nkompartemennya menjadi 51 lantai, kata Ivan menambahkan. (rhd/die) &lt;br&gt;&lt;br&gt;Sumber : Fajar.co.id&lt;br&gt;', '2013-11-15', 1, 'Luxurious_Apartment_1_thumb.jpg', 'Luxurious_Apartment_1.jpg');
