(149, 'Jual Tanah di Kab. Luwu Timur', 'Jln. Trans Makassar', NULL, '550ribu/m2', '', 'Sertifikat Hak Milik', 'bekas', '119.919370125', '-4.938964184545017', '8', 1, '', '', 0, 0, 0, '', '', '', '', 'furnished', 0, 100000, 'Dicari pembeli lahan atau investor property sistem bagi hasil untuk lahan milik orang tua kami.\n\n-1) Luas lahan 10 HA\n-2)Terletak 100 meter dari tepi jalan,sementara bagian depan yang berhadapan langsung dengan jalan raya Trans Sulawesi akan dibangun SPBU (Pertamina),pusat perbelanjaan terbesar pertama di Luwu Timur dan Luwu Utara,restoran dan kafe.\n-3)Berhadapan dengan lokasi akan ada sebuah kompleks perumahan warga yang akan dikembangkan menjadi kompleks wisata bunga.\n-4) Lokasi lahan berada\n-+ 45 menit dari kota Soroako ( lokasi PT Inco TBK),\n-+ 30 menit dari kota Malili (Ibu Kota Kabupaten)\n-+ 10 menit dari kota Mangkutana ( Hotel,kampus dan Pusat Hiburan)\n-+ 5 menit dari kota Wotu (RSUD I Lagaligo,kampus dan pusat pendidikan).\n-5) Lokasi lahan berada di desa Bone Pute,Kec.Burau,Kab.Luwu Timur yang mana tengah dipersiapkan untuk menjadi Ibu Kota Kecamatan baru.\n\nCp. - Marvin 082-344-671-480 ( emailmarvin30@yahoo.co.uk )', '', 0, 0, 'Ya', 'kontraktor', 'CEFC530CAE8D922F1B7C2D273DEDF176'),
