INSERT INTO `tbl_page` (`id_page`, `title`, `nama`, `content`) VALUES
(19, 'Tentang Rumahta.com', 'Tentang Rumahta.com', '&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;a href=&quot;http://rumahta.com/CompanyProfile_Rumahta.com.pdf&quot; target=&quot;_blank&quot;&gt;Klik disini untuk melihat Company Profie Rumahta.com&lt;/a&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;&quot; height=&quot;398&quot; src=&quot;http://rumahta.com/content_upload/images/akun gratis.png&quot; width=&quot;418&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;strong&gt;Selamat Datang di Rumahta.com&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;Bersama dengan ini kami memperkenalkan CV. Ashar Pratama perusahaan yang bergerak dalam bidang jasa dan promosi, salah satu produk kami adalah Rumahta.com yaitu media jasa periklanan properti secara online yang berkonsentrasi mempromosikan properti-properti khususnya yang ada diwilayah Sulawesi Selatan dan online sejak awal Januari 2013. Adapun target pengunjung Rumahta.com adalah para pencari properti, khususnya yang ada di daerah Sulawesi Selatan dan di seluruh Indonesia pada umumnya.&lt;/p&gt;\n\n&lt;p&gt;Website Rumahta.com dibuat secara profesional oleh ahlinya bukan dengan cara memodifikasi iklan properti yang telah ada atau bisa disebut cloningan, website ini dibuat selama 6 bulan dengan fitur-fitur yang lengkap dan dapat menyampaikan informasi properti Anda secara detail ke calon pembeli/penyewa properti Anda.&lt;/p&gt;\n\n&lt;p&gt;Perkembangan pesat dunia internet saat ini khususnya di Indonesia memberikan peluang besar serta menjanjikan untuk mempromosikan atau memasarkan properti Anda di Rumahta.com.&lt;/p&gt;\n\n&lt;p&gt;Rumahta.com &lt;strong&gt;bukanlah&lt;/strong&gt; broker atau agen properti. Rumahta.com hadir sebagai media jasa periklanan properti online dan sebagai wadah para pemilik properti untuk memasarkan propertinya baik yang baru maupun bekas, menghubungkan pemilik properti dengan calon pembeli dan penyewa serta membantu calon pembeli dan penyewa dalam mencari properti sesuai yang diinginkannya di daerah Makassar maupun diseluruh daerah di Sulawesi Selatan.&lt;/p&gt;\n\n&lt;p&gt;Layanan periklanan Rumahta.com tidak memungut biaya komisi dari calon pembeli/penyewa begitupun sebaliknya kepada penjual/penyewa bila terjadi transaksi. Rumahta.com hanya memperoleh pendapatan dari biaya pasang iklan.&lt;/p&gt;\n\n&lt;p&gt;Sekarang sudah tidak jaman lagi cari-cari rumah, tanah, kostan, apartemen dan tempat usaha di Sulawesi Selatan dengan bertanya kesana kemari, kini calon pembeli/penyewa tinggal browser di Rumahta.com melalui PC, Laptop, Handphone, Smartphone maupun Tablet, calon pembeli/penyewa akan dengan mudah menemukan properti favorit sesuai spesifikasi yang diinginkan dengan cepat, praktis, hemat biaya, juga dapat melihat tipe, foto yang menarik, fasilitas serta kisaran harga. Semua dengan cepat dan mudah ditampilkan.&lt;/p&gt;\n\n&lt;p&gt;Bagi &lt;strong&gt;calon pembeli/penyewa properti&lt;/strong&gt;, dapat langsung &amp;ldquo;&lt;strong&gt;&lt;em&gt;mencari&amp;rdquo;&lt;/em&gt;&lt;/strong&gt; properti pilihan sesuai dengan tipe, harga dan lokasi properti yang dikehendaki secara gratis. Jika mereka tertarik dengan salah satu properti, mereka dapat langsung menghubungi nomor kontak pemilik properti yang ada di halaman detail iklan listing properti tersebut tanpa melalui pengelola Rumahta.com.&lt;br /&gt;\n&lt;br /&gt;\nBagi &lt;strong&gt;penjual/penyewa properti&lt;/strong&gt;, Rumahta.com merupakan solusi yang tepat untuk penjualan atau menyewakan propertinya yang ada didaerah Sulawesi Selatan, karena kami menyediakan layanan &amp;ldquo;One Step Solution For Selling/rent Your Property&amp;rdquo;.&lt;/p&gt;\n\n&lt;p&gt;Untuk pemasangan iklan silakan mendaftar GRATIS terlebih dahulu di halaman &amp;ldquo;Pendaftaran Member&amp;rdquo; dengan klik &lt;strong&gt;&lt;a href=&quot;http://rumahta.com/page/page_detail/15/pasang-iklan&quot;&gt;&amp;lsquo;Daftar Sekarang&amp;rsquo;&lt;/a&gt;&lt;/strong&gt; pojok kanan atas.&lt;/p&gt;\n\n&lt;p&gt;Demikian tentang rumahta.com, terima kasih atas kunjungan Anda.&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\nSalam kami,&lt;br /&gt;\n&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;Admin Rumahta.com&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;strong&gt;Visi&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\n&lt;br /&gt;\n&amp;ldquo;Menjadi media iklan properti online yang profesional dan terpercaya, serta mampu memberi kualitas layanan, fasilitas produk dan jasa properti pada pelanggan, serta mampu bertumbuh kembang bersama mitra properti secara profesional khususnya yang ada di daerah Sulawesi Selatan&amp;rdquo;.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;strong&gt;Misi&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;Memposisikan Rumahta.com yang bereputasi&amp;nbsp;dalam hal &lt;strong&gt;menyampaikan informasi properti&lt;/strong&gt; yang sedang berkembang di Sulawesi Selatan.&lt;/li&gt;\n &lt;li&gt;Memberikan &lt;strong&gt;solusi akan kebutuhan informasi&lt;/strong&gt; mengenai hunian dan properti khususnya yang ada di daerah Sulawesi Selatan.&lt;/li&gt;\n &lt;li&gt;Mempunyai pertumbuhan yang &lt;strong&gt;berkesinambungan dan berkarakter&lt;/strong&gt; dalam segala hal, baik untuk Rumahta.com maupun masyarakat khususnya di Sulawesi Selatan.&lt;/li&gt;\n &lt;li&gt;Mengembangkan dan menerapkan &lt;strong&gt;inovasi-inovasi baru dalam hal produk dan servis &lt;/strong&gt;yang dibutuhkan dan diinginkan para Penjual dan Pembeli properti.&lt;/li&gt;\n &lt;li&gt;&lt;strong&gt;Membangun kepercayaan konsumen&lt;/strong&gt; pada kemampuan sistem pemasaran &lt;strong&gt;rumahta.com&lt;/strong&gt; yang agresif, cepat bertindak, professional, dan beretika demi kepuasan dan kesetiaan konsumen yang berkesinambungan.&lt;/li&gt;\n &lt;li&gt;&lt;strong&gt;Menciptakaan jaringan dan kerja-sama yang baik, &lt;/strong&gt;termasuk dengan agent properti, developer, notaris, investor dll.&lt;/li&gt;\n&lt;/ol&gt;'),
(20, 'Aturan dan Ketentuan', 'Aturan dan Ketentuan Pendaftaran', '&lt;p&gt;&lt;em&gt;&lt;strong&gt;Dengan menggunakan rumahta.com, Anda setuju bahwa anda tidak akan :&lt;/strong&gt;&lt;/em&gt;&lt;br /&gt;\n&amp;nbsp;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;Menggunakan segala jenis alat, software, atau proses untuk mengakses, mengambil, menghilangkan semua isi rumahta.com.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Menggunakan segala jenis alat, software, atau proses untuk menggangu cara kerja rumahta.com.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Melakukan segala aksi yang akan membebani atau membuat kekacauan di sistem kami.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Menggunakan segala isi rumahta.com untuk membangun atau mengisi properti database atau berkompetisi dengan kami menggunakan cara apapun.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Trasmisi spam, surat berantai, junk emails, survei atau pesan massal dalam bentuk apapun.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Menggunakan rumahta.com atau segala isi dari rumahta.com dengan cara apapun yang tidak sesuai dengan tujuan yang dimaksud.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Melanggar hak siapapun termasuk copyright, rahasia perdagangan, privasi atau segala jenis intellectual property.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Berpura pura menjadi seseorang atau organisasi untuk mencuri uang, password atau informasi personal dari siapa pun.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Melanggar syarat penggunaan atau kondisi yang kami tentukan atau hukum-hukum sejenisnya.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Meniru, menerbitkan kembali, menyebarkan, mengganti, mengadopsi, menerjemahkan, menggandakan rumahta.com beserta segala isinya dengan cara apapun tanpa autorisasi dari kami.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Menyebarkan atau berusaha menyebarkan segala jenis virus komputer, worms, kerusakan, Trojan horses atau apapun yang sifatnya merusak.&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&lt;br /&gt;\nPada saat anda menggunakan jasa layanan kami, maka anda dianggap telah membaca, memahami dan menyetujui dengan seluruh klausul dari syarat dan ketentuan yang berlaku.&lt;br /&gt;\n&lt;br /&gt;\nAturan dan Ketentuan, Kebijakan Privasi, dan notis-notis lainnya mengandung seluruh perjanjian antara anda dan kami sehubungan dengan penggunaan website rumahta.com.&lt;br /&gt;\n&lt;br /&gt;\nJika dari ketentuan ini ada yang bertentangan dengan hukum yang berlaku, maka ketentuan tersebut menjadi tidak berlaku, akan tetapi ketentuan lainnya masih akan tetap berlaku.&lt;br /&gt;\n&lt;br /&gt;\nKami menyarankan anda secara berkala untuk meninjau kembali dan memahami setiap perubahan yang terjadi pada Syarat dan Ketentuan dari rumahta.com.&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;Silakan lanjutkan untuk menjadi member kami secara GRATIS.&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;color:#B22222;&quot;&gt;&lt;em&gt;Untuk keluar silakan klik tanda silang &lt;/em&gt;(&lt;/span&gt;&lt;span style=&quot;font-family:comic sans ms,cursive;&quot;&gt;&lt;span style=&quot;color: rgb(169, 169, 169);&quot;&gt;&lt;strong&gt;X&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color:#B22222;&quot;&gt;)&lt;em&gt; dikanan atas halaman ini!&lt;/em&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;'),
(2, 'Info KPR', 'Info KPR Makassar', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;strong&gt;Syarat KPR &lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Syarat KPR secara umum :&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Warga Negara Indonesia (WNI).&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Tidak masuk dalam anggota Bank Likuiditas Bank Indonesia (BLBI). Istilah umumnya Daftar Hitam Bank Indonesia.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Minimal berusia 21 tahun atau sudah menikah.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pada saat jatuh tempo, maksimal berusia 55 tahun untuk calon debitur berpenghasilan tetap atau pegawai. Maksimal berusia 60 tahun untuk guru, guru besar, profesor, hakim, atau jaksa. Maksimal berusia 65 tahun untuk profesional atau wiraswasta.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Menyerahkan surat permohonan yang dilampiri :&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Fotokopi KTP pemohon&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Fotokopi KTP suami/istri&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Fotokopi kartu keluarga (KK)&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Fotokopi akta nikah, akta Cerai, atau akta pisah harta&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Fotokopi NPWP&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Fotokopi rekening koran/Tabungan/Giro tiga bulan terakhir&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pas foto suami dan istri masing-masing sebanyak dua lembar ukuran 4x6 cm&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Fotokopi dokumen jaminan seperti SHM, AJB, IMB dan PBB&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Syarat KPR khusus:&lt;/strong&gt;&lt;br /&gt;\n&lt;br /&gt;\n&lt;strong&gt;A. Syarat KPR khusus Pegawai/Karyawan&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;strong&gt;:&lt;/strong&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Slip Gaji/Surat Keterangan Gaji per bulan&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Fotokopi SK (surat keputusan) pegawai tetap dan dilegalisasi oleh perusahaan&lt;/span&gt;&lt;/span&gt;.&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;B. Syarat KPR khusus Pengusaha/Wiraswasta/Berpenghasilan Tidak Tetap:&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Izin usaha (SIUP, TDP, dan NPWP).&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Akta pendirian perusahaan&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Menyerahkan laporan keuangan dua tahun terakhir.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Mutasi rekening di bank minimum tiga bulan&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;C. Syarat KPR Khusus Profesional (dokter, apoteker, bidan, pengacara, &amp;nbsp;notaris) :&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Fotokopi Legalitas praktik/surat izin praktik yang masih berlaku.&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Menyerahkan perincian pendapatan praktik per bulan.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Mutasi rekening di bank.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Memiliki reputasi baik.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Hal yang patut diingat adalah memilih bank tujuan pengajuan KPR yang terpercaya dan kredible. Akan lebih baik jika bank tersebut sudah biasa dimanfaatkan jasanya oleh Anda&lt;/span&gt;&lt;/span&gt;.&lt;/p&gt;'),
(3, 'Kontak', 'Kontak', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;Jika ada yang ingin ditanyakan &lt;span style=&quot;font-family:arial,helvetica,sans-serif;&quot;&gt;&lt;font size=&quot;2&quot;&gt;silakan hubungi kami melalui No. Telp. atau email di bawah ini&lt;/font&gt;&lt;/span&gt;. &lt;span style=&quot;font-family:arial,helvetica,sans-serif;&quot;&gt;&lt;font size=&quot;2&quot;&gt;Sebelum mengajukan pertanyaan, pastikan anda mencari jawabannya di HALAMAN FAQ (&lt;strong&gt;&lt;a href=&quot;http://rumahta.com/page/page_detail/7/faq&quot;&gt;klik disini&lt;/a&gt;&lt;/strong&gt;).&lt;/font&gt; &lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;Admin rumahta.com&lt;/p&gt;\n\n&lt;p&gt;Cp. 0411-5771447 / &lt;span style=&quot;font-family: verdana,sans-serif;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;span style=&quot;font-family: verdana,sans-serif;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;span style=&quot;font-family: verdana,sans-serif;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;span style=&quot;font-family: verdana,sans-serif;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;span style=&quot;font-family: verdana,sans-serif;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;span style=&quot;font-family: verdana,sans-serif;&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;081355386147&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;Email : admin&lt;small&gt;@&lt;/small&gt;rumahta.com&lt;/p&gt;\n\n&lt;p&gt;Alamat : Jl. Bontomene No. 19 Makassar&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Facebook&amp;nbsp; :&lt;/strong&gt; rumahtacom&lt;br /&gt;\n&lt;strong&gt;Twitter &amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp; :&lt;/strong&gt; @rumahtacom&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Ingin mengetahui tentang rumahta.com? &lt;strong&gt;&lt;a href=&quot;http://rumahta.com/page/page_detail/19/tentang-rumahta&quot;&gt;KLIK DISINI&lt;/a&gt; &lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Untuk melihat Company Profie Rumahta.com &lt;strong&gt;&lt;a href=&quot;http://rumahta.com/CompanyProfile_Rumahta.com.pdf&quot; target=&quot;_blank&quot;&gt;KLIK DISINI&lt;/a&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;'),
(5, 'Spesifikasi Iklan', 'Spesifikasi Iklan', '&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Jenis properti dan jasa yang diiklankan :&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Properti :&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Rumah dijual/disewakan&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Apartemen dijual/disewakan&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Tanah dijual/disewakan&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Ruko/rukan dijual/disewakan&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Kios dijual/disewakan&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Gudang/pabrik dijual/disewakan&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;ol&gt;\n &lt;li value=&quot;2&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Kostan&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li value=&quot;3&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Jasa :&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Kontraktor&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Arsitektur&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Kontraktor/arsitektur&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Toko bahan bangunan&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Tukang/buruh bangunan&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Rumahta.com menyediakan dua spesifikasi iklan yaitu Iklan Listing dan Iklan Banner, sebagai berikut :&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 153, 0);&quot;&gt;&lt;strong&gt;IKLAN LISTING&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;em&gt;&lt;strong&gt;Iklan Listing terbagi dua yaitu &amp;ldquo;Gratis&amp;rdquo; dan &amp;ldquo;Premium&amp;rdquo;, perbedaannya yaitu:&lt;/strong&gt;&lt;/em&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Iklan Listing Gratis&lt;/strong&gt;, posisi iklan listingnya berada dibawah seluruh iklan listing premium.&amp;nbsp; Dapat memposting hingga 100 iklan listing gratis dengan masing-masing listing berdurasi &lt;/span&gt;12 bulan &lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;dan disetiap postingan hanya dapat memasang maksimal 3 foto bagian-bagian properti Anda.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;Iklan Listing Premium&lt;/strong&gt; (Berbayar), selalu berada diatas iklan listing gratis. Listing iklan premium lebih menonjol dengan &lt;em&gt;&lt;u&gt;warna lebih mencolok&lt;/u&gt;&lt;/em&gt; dan meningkatkan kesempatan untuk lebih banyak yang melihat iklan Anda, selain itu iklan Anda tampil terus menerus setiap hari selama 12 bulan. Setiap postingan Anda dapat memasang&amp;nbsp; hingga 7 foto bagian-bagian properti anda, setiap member dapat memesan beberapa paket listing yang bisa Anda pilih, sebagai berikut :&lt;/span&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Paket 1&lt;/strong&gt; &amp;gt; Pemasangan 1 iklan listing premium dengan durasi tayang 12 bulan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Paket 15&lt;/strong&gt; &amp;gt; Pemasangan 15 iklan listing premium dengan masing-masing durasi &amp;nbsp;tayang 12 bulan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Paket 50&lt;/strong&gt; &amp;gt; Pemasangan 50 iklan listing premium dengan masing-masing durasi &amp;nbsp;tayang 12 bulan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Paket 75&lt;/strong&gt; &amp;gt; Pemasangan 75 iklan listing premium dengan masing-masing durasi &amp;nbsp;tayang 12 bulan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Paket 100&lt;/strong&gt; &amp;gt; Pemasangan 100 iklan listing premium dengan masing-masing durasi &amp;nbsp;tayang 12 bulan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Paket 250&lt;/strong&gt; &amp;gt; Pemasangan 250 iklan listing premium dengan masing-masing durasi &amp;nbsp;tayang 12 bulan.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 153, 0);&quot;&gt;&lt;strong&gt;IKLAN BANNER&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;em&gt;&lt;strong&gt;Iklan Banner terdiri dari 3 posisi di rumahta.com, yaitu :&lt;/strong&gt;&lt;/em&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Banner Atas&lt;/strong&gt; &amp;gt; Tersedia 1 (Satu) slot dengan ukuran 560 x 165 pixel, posisinya bagian atas halaman, di sebelah maskot website. Adapun pilihan durasi tayang iklan banner yang dapat dipilih, yaitu: 3 Bulan, 6 Bulan dan 12 Bulan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Banner Samping&lt;/strong&gt; &amp;gt; Tersedia 5 (Lima) slot dengan ukuran 200 x 160 pixel, di bagian samping halaman, di bawah kalkulator KPR. Adapun pilihan durasi tayang iklan banner yang dapat dipilih, yaitu: 3 Bulan, 6 Bulan dan 12 Bulan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Banner Bawah&lt;/strong&gt; &amp;gt; Tersedia 2 (Dua) slot dengan ukuran 455 x 120 pixel, di bagian bawah halaman, di atas berita dan testimoni. Adapun pilihan durasi tayang iklan banner yang dapat dipilih, yaitu: 3 Bulan, 6 Bulan dan 12 Bulan.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;*&lt;/strong&gt;Semua banner terlihat disetiap halaman versi desktop kecuali pada versi mobile, banner tidak ditampilkan.&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color:#0000FF;&quot;&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;strong&gt;Keuntungan beriklan online di rumahta.com&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Banyak yang bertanya apakah iklan online efektif ?&lt;/strong&gt;&lt;br /&gt;\nJawabannya adalah sangat efektif, karna disini iklan yang Anda pasang akan dilihat ratusan orang diseluruh Indonesia hingga seluruh dunia.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Kenapa bisa begitu ?&lt;/strong&gt;&lt;br /&gt;\nYah, karena saat ini pengguna internet di Indonesia bisa dikatakan terus meningkat, nah dari sinilah kita melihat peluang yang begitu bagus bagi pencari rumah, tanah, kostan, apartemen, ruko/rukan, kios atau gudang/pabrik di Makassar maupun di seluruh Sulawesi Selatan.&lt;/p&gt;\n\n&lt;p&gt;Perkembangan teknologi serta kecanggihannya telah memudahkan pengguna &lt;em&gt;internet&lt;/em&gt; mencari dan menjual properti lewat media &lt;em&gt;online&lt;/em&gt;. Membaiknya pertumbuhan tersebut memberi peluang bagi Rumahta.com, untuk senantiasa menyajikan ragam kemudahan bagi pencari properti di Sulawesi Selatan.&lt;/p&gt;\n\n&lt;p&gt;Sebenarnya banyak sekali manfaat yang didapat dari beriklan di Rumahta.com. &lt;strong&gt;Ingin tahu apa saja manfaat dari beriklan online di Rumahta.com&lt;/strong&gt;? Langsung saja kita lihat dibawah ini :&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;Anda bisa menggunakan waktu anda untuk hal-hal lain yang lebih memerlukan penanganan Anda secara langsung.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Pemasangan iklan dilakukan secara manual, tanpa menggunakan software apapun sehingga dijamin iklan Anda pasti terpasang.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Iklan properti dapat Anda edit atau tambahkan keterangan selengkap-lengkapnya setiap saat.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Peningkatan jumlah pengunjung ke iklan Anda secara signifikan, artinya potensi yang melihat properti Anda semakin lebih besar.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Iklan Anda akan secara otomatis akan masuk ke daftar pencarian Search Engine terkemuka seperti Google, Yahoo dan yang lainnya!&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Anda akan mendapat satu buah URL khusus untuk memperkenalkan properti-properti Anda secara pribadi, misal : &lt;strong&gt;&lt;em&gt;http://rumahta.com/Nama_Anda&lt;/em&gt;&lt;/strong&gt; atau &lt;strong&gt;&lt;em&gt;http://rumahta.com/Nama_Perusahaan &lt;/em&gt;&lt;/strong&gt;(Nama_Anda atau Nama_Perusahaan bisa Anda buat dengan nama lain dimember area).&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Calon pembeli/penyewa properti langsung mengontak atau menghubungi Anda tanpa menghubungi atau melalui pengelola rumahta.com.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Rumahta.com tidak memungut biaya komisi dari calon pembeli atau penyewa maupun penjual atau agen properti bila terjadi transaksi.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Beriklan di Rumahta.com, biayanya lebih kecil dibandingkan dengan biaya pasang iklan dimedia cetak, radio, televisi, dll.&amp;nbsp;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Iklan properti Anda tampil di Rumahta.com selama 12 bulan sejak iklan Anda terpasang.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Untuk mendapatkan properti yang diinginkan, selain simpel dan praktis. Pembeli/penyewa dapat mengakses dengan cepat kapan dan dimanapun mereka berada calon pembeli/penyewa properti Anda tersebut akan dengan mudah menemukan properti favorit sesuai spesifikasi yang diinginkan melalui &lt;strong&gt;PC, Laptop, Handphone, Smartphone maupun Tablet&lt;/strong&gt;.&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;Informasi iklan Anda dapat langsung menarik perhatian dengan menggunakan foto-foto, deskripsi, peta google, serta fitur-fitur lain properti Anda.&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;Mungkin bagi Anda yang ingin propertinya diiklankan, Anda dapat menggunakan jasa Rumahta.com. Dengan begitu akan ada banyak ratusan pasang mata yang akan melihat properti Anda dengan memasukan iklan properti Anda dimesin pencari seperti google dan yahoo melalui Rumahta.com, Rumahta.com selain sosialisasi secara online Rumahta.com juga melakukan secara offline. Ini adalah &lt;strong&gt;cara cepat mendatangkan pengunjung ke Rumahta.com&lt;/strong&gt; sendiri dan itu akan otomatis dengan cepat menemukan iklan properti Anda.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Target pengiklan :&lt;/strong&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;Marketing developer/perumahan,&lt;/li&gt;\n &lt;li&gt;Marketing agen/agen independen/broker properti,&lt;/li&gt;\n &lt;li&gt;Individu atau pribadi pemilik properti.&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Jenis properti dan jasa yang diiklankan :&lt;/strong&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;strong&gt;Properti :&lt;/strong&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;ul&gt;\n &lt;li&gt;Rumah dijual/disewakan&lt;/li&gt;\n &lt;li&gt;Apartemen dijual/disewakan&lt;/li&gt;\n &lt;li&gt;Tanah dijual/disewakan&lt;/li&gt;\n &lt;li&gt;Ruko/rukan dijual/disewakan&lt;/li&gt;\n &lt;li&gt;Kios dijual/disewakan&lt;/li&gt;\n &lt;li&gt;Gudang/pabrik dijual/disewakan&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;ol&gt;\n &lt;li value=&quot;2&quot;&gt;&lt;strong&gt;Kostan&lt;/strong&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li value=&quot;3&quot;&gt;&lt;strong&gt;Jasa :&lt;/strong&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;ul&gt;\n &lt;li&gt;Kontraktor&lt;/li&gt;\n &lt;li&gt;Arsitektur&lt;/li&gt;\n &lt;li&gt;Kontraktor/arsitektur&lt;/li&gt;\n &lt;li&gt;Toko bahan bangunan&lt;/li&gt;\n &lt;li&gt;Tukang/buruh bangunan&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;Adapun sistem sosialisasi untuk memperkenalkan rumahta.com pada masyarakat Sulawesi Selatan, sebagai berikut :&lt;/p&gt;\n\n&lt;p&gt;Persentase sosialisasi rumahta.com :&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Secara Offline &lt;/strong&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;Media massa,&lt;/li&gt;\n &lt;li&gt;Majalah,&lt;/li&gt;\n &lt;li&gt;Stiker,&lt;/li&gt;\n &lt;li&gt;Poster,&lt;/li&gt;\n &lt;li&gt;T-Shirt,&lt;/li&gt;\n &lt;li&gt;Souvenir,&lt;/li&gt;\n &lt;li&gt;Orang ke orang,&lt;/li&gt;\n &lt;li&gt;Dll.&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&lt;strong&gt;Secara Online &lt;/strong&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;Situs Pencari (Google, Yahoo, Dll),&lt;/li&gt;\n &lt;li&gt;Sosial Media (Facebook, Twitter, Dll),&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Broadcast&lt;/em&gt; &lt;em&gt;BlackBerry&lt;/em&gt; Messenger,&lt;/li&gt;\n &lt;li&gt;Dll.&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;Dengan sisialisasi ini melekatkan rumahta.com kepada masyarakat sebagai situs informasi properti khusus untuk daerah di Sulawesi Selatan :&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;&amp;ldquo;Sekarang bukan jamannya mencari Rumah, Tanah, Kostan, Apartemen, Ruko/Rukan, Kios, atau Gudang/Pabrik &amp;nbsp;di Sulawesi Selatan dengan bertanya kesana kemari, kini dengan mudahnya Anda temukan di Rumahta.com&amp;rdquo;.&lt;/em&gt;&lt;/p&gt;');
INSERT INTO `tbl_page` (`id_page`, `title`, `nama`, `content`) VALUES
(6, 'Syarat dan Ketentuan', 'Syarat dan Ketentuan', '&lt;p style=&quot;text-align: center;&quot;&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;font-family: lucida sans unicode,lucida grande,sans-serif;&quot;&gt;&lt;strong&gt;Syarat dan Ketentuan&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;Selamat datang di rumahta.com, sebuah media iklan properti online yang dikelola oleh CV. Ashar Pratama, demi kenyamanan bersama maka kami memberlakukan Syarat Dan Ketentuan dalam penggunaan jasa kami.&lt;br /&gt;\n&lt;br /&gt;\n&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;A.&lt;/strong&gt;&lt;/span&gt; Syarat Dan Ketentuan berlaku pada saat anda menggunakan layanan kami dan akan terus berlaku selama anda&amp;nbsp;&amp;nbsp; masih menjadi anggota kami.&amp;nbsp;&lt;br /&gt;\n&lt;br /&gt;\nAnda berhak untuk memutuskan keanggotaan dengan cara menghubungi kami secara langsung.&amp;nbsp; Apabila anda, kami anggap lalai dalam mematuhi Syarat Dan Ketentuan yang berlaku, maka kami berhak untuk memutuskan anda dari keanggotaan.&lt;br /&gt;\n&lt;br /&gt;\nAnda tidak berhak atas penggantian dalam bentuk apapun yang telah dibayarkan kepada kami pada saat anda memutuskan ataupun diputuskan keanggotaan anda.&lt;br /&gt;\n&lt;br /&gt;\n&lt;br /&gt;\n&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;B.&lt;/strong&gt;&lt;/span&gt; Apabila anda telah mendaftar akan menjadi anggota rumahta.com. Setelah proses pendaftaran berhasil, anda akan menerima link aktivasi user-id dan password yang telah anda daftarkan.&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Jika Anda merupakan suatu badan usaha, anda mengakui bahwa:&lt;/strong&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;Anda memiliki otoritas untuk mengikatkan badan usaha dengan Syarat Dan Ketentuan yang berlaku.&lt;/li&gt;\n &lt;li&gt;Alamat yang digunakan pada saat pendaftaran adalah alamat badan usaha.&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Semua informasi yang anda masukan adalah benar, akurat, berlaku, lengkap dan dapat dipertanggung jawabkan.&lt;br /&gt;\n&lt;br /&gt;\n&lt;strong&gt;Dengan menggunakan jasa layanan kami, maka Anda setuju atas:&lt;/strong&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;Mengisi formulir pendaftaran dengan jujur, akurat, lengkap dan data yang dapat dipertanggung jawabakan.&amp;nbsp; Pada saat pendaftaran, anda dilarang untuk menggunakan data orang lain.&lt;/li&gt;\n &lt;li&gt;Memelihara keakuratan data anda.&lt;/li&gt;\n &lt;li&gt;Bertanggung jawab penuh atas kerahasiaan akun anda. Segala konsekensi dari aktifitas oleh pihak ketiga yang menyalah-gunakan akun anda menjadi tanggung jawab anda.&lt;/li&gt;\n &lt;li&gt;Anda tidak berhak atas penggantian apapun baik semua maupun sebagian uang yang telah dibayarkan kepada kami, apabila anda masih memiliki kredit pada akun anda akan tetapi kredit tersebut telah habis masa tenggangnya.&lt;/li&gt;\n &lt;li&gt;Semua materi yang diiklankan disediakan Anda sebagai pengiklan.&lt;/li&gt;\n &lt;li&gt;Seluruh listing berada dibawah setiap ada listing terbar.&lt;/li&gt;\n &lt;li&gt;Listing properti yang sama tapi dipasang di beberapa area yang berbeda tidak diperbolehkan. Contoh: detail properti, harga, dan foto sama tetapi area beda.&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;Anda dilarang menjual, memberikan atau mentransfer akun anda kepada siapapun tanpa ijin tertulis dari kami.&amp;nbsp; Pelanggaran akan ketentuan tersebut dapat menyebabkan pemutusan keanggotaan anda.&lt;br /&gt;\n&lt;br /&gt;\nKami berhak menolak pendaftaran ulang dimana anda pernah mengalami pemutusan keanggotaan yang disebabkan oleh pelanggaran dari Syarat dan Ketentuan yang berlaku.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;C. PERILAKU PENGGUNA&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;Anda memahami sepenuhnya bahwa website kami adalah media iklan online yang hanya menyediakan jasa informasi.&amp;nbsp; Segala transaksi yang terjadi antara penjual dan pembeli serta akibat yang ditimbulkan atas aktifitas tersebut bukan menjadi tanggung jawab kami.&lt;/p&gt;\n\n&lt;p&gt;Anda mengakui dan menyetujui sepenuhnya bahwa semua materi iklan yang anda posting pada website kami tidak mengandung pelanggaran hukum dan melanggar hak cipta pihak ketiga yang juga termasuk merek dagang, privasi, publisitas dan hak intelektual.&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;strong&gt;Anda setuju tidak melakukan:&lt;/strong&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;Mencantumkan URL alamat website lain di isi konten iklan.&lt;/li&gt;\n &lt;li&gt;Reproduksi, mengunduh informasi, gambar, kalimat, file, database ataupun listing yang ada pada website kami dengan tujuan komersial, persaingan usaha sejenis, dan eksploitasi isi konten dari rumahta.com&lt;/li&gt;\n &lt;li&gt;Anda dilarang menggunakan sebagian ataupun seluruh isi konten website kami tanpa adanya ijin tertulis dari kami.&lt;/li&gt;\n &lt;li&gt;Mengambil database alamat email anggota kami dengan cara dan tujuan apapun.&lt;/li&gt;\n &lt;li&gt;Mencoba meretas jaringan / membuat sistem kami menjadi overload.&lt;br /&gt;\n Memposting materi iklan yang dianggap berbahaya, mengancam, menghina, vulgar, menipu, provokatif dalam hal SARA, pronografi dan tindakan-tindakan di luar hukum.&lt;/li&gt;\n &lt;li&gt;Menciptakan identitas palsu.&lt;/li&gt;\n &lt;li&gt;Mendaftar dengan membalikkan identitas diri.&lt;/li&gt;\n &lt;li&gt;Memposting junk mail, spam, surat berantai, skema piramid atau lainnya yang sejenis.&lt;/li&gt;\n &lt;li&gt;Tanpa persetujuan terlebih dahulu melakukan posting data personal pihak ketiga seperti alamat, nomor telepon, email, nomor kartu kredit dan lain sebagainya.&lt;/li&gt;\n &lt;li&gt;Mengambil informasi personal dengan tujuan melanggar hukum.&lt;/li&gt;\n &lt;li&gt;Mentransimisikan materi apapun yang mengandung virus software, ataupun kode-kode computer, file atau program yang didisain untuk menganggu, merusak fungsi dari hardwarealat telekomunikasi.&lt;br /&gt;\n Mengitimidasi pihak lain.&lt;/li&gt;\n &lt;li&gt;Memposting iklan yang dapat memprovokasi kegiatan kriminalitas, melanggar hak pihak lain, ataupun melanggar hukum.&lt;/li&gt;\n &lt;li&gt;Mencoba menggunakan akun orang lain, jasa layanan, atau sistim tanpa ijin terlebih dahulu dari kami.&lt;/li&gt;\n &lt;li&gt;Meng-upload, posting, transmit, share isi konten yang dapat membahayakan kami dan pengguna lainnya termasuk bahaya yang mengakibatkan tuntutan hukum kepada kami.&lt;/li&gt;\n &lt;li&gt;Kami dapat menyediakan link dari pihak ketiga akan tetapi kami tidak memiliki control atas website tersebut.&amp;nbsp; Kami tidak bertanggung jawab atas layanan yang diberikan oleh pihak ketiga tersebut.&amp;nbsp; Kami menyarankan anda untuk memahami ketentuan-ketentuan yang berlaku pada website pihak ketiga tersebut.&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;D. TRANSAKSI&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;Sebagai media informasi, kami tidak mewakili penjual atau pembeli.&amp;nbsp; Oleh karena itu kami tidak memiliki kontrol dan tidak bertanggung jawab atas kualitas, keamanan, kebenaran hukum, atau kesediaan barang dan/atau jasa oleh penjual dan juga hal kemampuan pembeli dalam memenuhi pembelian.&lt;br /&gt;\n&lt;br /&gt;\nAnda bertanggung jawab sepenuhnya atas segala ketentuan dan syarat&amp;nbsp; transaksi atas informasi barang dan/atau jasa yang kami tayangkan temasuk dan tidak dibatasi oleh pembayaran, retur, garansi, biaya transportasi, asuransi, pajak, surat ijin, denda, dan biaya-biaya lain yang berhubungan dengan jual beli barang dan/atau jasa.&lt;/p&gt;\n\n&lt;p&gt;Anda setuju untuk tidak melibatkan kami dari segala bentuk tuntutan hukum apabila terjadi sengketa antara penjual dan pembeli atas barang dan/atau jasa yang kami tayangkan.&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;E. HAK CIPTA ATAS KONTEN&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;Hak atas konten yang ditayangkan oleh rumahta.com dan anggota Segala hak milik yang terdapat dalam jasa layanan kami adalah sepenuhnya milik kami.&amp;nbsp; Anda dilarang keras tanpa ijin tertulis membuat salinan, mengubah, mempublikasikan, mengedarkan, mejual, menayangkan materi yang terdapat pada domain umum website rumahta.com.&lt;br /&gt;\n&lt;br /&gt;\n&lt;strong&gt;Hak konten anda&lt;/strong&gt;&lt;br /&gt;\nKami tidak mengakui hak kepimilikan atas materi yang anda sediakan.&amp;nbsp; Tetapi dengan anda menggunakan jasa layanan kami, berarti anda setuju agar materi anda dapat dilihat, diunduh, dan berbagi keuntungan atas materi yang anda publikasikan.&lt;br /&gt;\n&lt;br /&gt;\nAnda bertanggung jawab atas segala materi yang anda tayangkan di website kami, oleh karena itu anda memiliki segala hak dan ijin atas segala materi anda, dan anda juga menyatakan tidak adanya pelanggaran atas hak kekayaan intelektual terhadap pihak manapun.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;F. BATAS KEWAJIBAN&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;Anda setuju dan memahami sepenuhnya bahwa:&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;Segala bentuk resiko dari penggunaan jasa layanan kami adalah tanggung jawab anda.&amp;nbsp; Kami memberikan layanan seperti apa adanya tanpa garansi atau jaminan dalam bentuk apapun.&lt;/li&gt;\n &lt;li&gt;Kami tidak menjamin memenuhi kepuasan Anda sepenuhnya.&lt;/li&gt;\n &lt;li&gt;Tanpa gangguan.&lt;/li&gt;\n &lt;li&gt;Kualitas barang dan/atau jasa yang diiklankan oleh anggota.&lt;/li&gt;\n &lt;li&gt;Segala materi yang anda download dari website kami menjadi tanggung jawab anda sepenuhnya demikian halnya dengan segala resikonya.&lt;/li&gt;\n &lt;li&gt;Segala kerugian yang mungkin timbul disebabkan oleh penggunaan website kami baik secara langsung maupun tidak langsung tidak menjadi tanggung jawab kami.&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;Segala petunjuk dan informasi yang anda dapatkan dari kami baik secara lisan maupun tulisan tidak menjadi suatu jaminan apapun.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;G. GANTI RUGI&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\n&lt;br /&gt;\nAnda setuju untuk melepaskan seluruh personel, perusahaan, dan pemilik rumahta.com, dan partner kami dari segala kerugian, tuntutan hukum, klaim, permintaan atau kerusakan, dan termasuk segala biaya ahli hukum yang sebabkan oleh:&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;Penggunaan Anda atas jasa layanan kami yang mana melanggar Syarat dan ketentuan yang berlaku.&lt;/li&gt;\n &lt;li&gt;Pelanggaran-pelanggaran lain atas syarat dan ketentuan yang berlaku.&lt;br /&gt;\n Segala pelanggaran mengenai keakuratan data personal anda.&lt;/li&gt;\n &lt;li&gt;Tuntutan hukum oleh pihak ketiga atas pelanggaran anda terhadap hak cipta mereka.&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;Anda bertanggung jawab atas segala biaya-biaya ang terjadi kepada kami yang disebabkan atas segala pelanggaran yang anda lakukan dalam menggunakan website kami.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;h4&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;H. KEWAJIBAN KAMI&lt;/span&gt;&lt;/span&gt;&lt;/h4&gt;\n\n&lt;p&gt;Materi yang ditayangkan disitus kami disediakan tanpa ketentuan atau jaminan apapun dalam hal ketepatannya. Sejauh diijinkan oleh hukum, kami dan para pihak ketiga yang berhubungan dengan kami dengan ini secara tegas mengecualikan:&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;Semua ketentuan, jaminan dan syarat lain yang dapat dinyatakan secara tidak langsung oleh undang-undang, hukum adat atau hukum keadilan.&lt;/li&gt;\n &lt;li&gt;Kewajiban atas kehilangan atau kerugian langsung, tidak langsung atau yang merupakan akibat yang ditanggung oleh pengguna dalam hubungannya dengan situs kami atau dalam hubungannya dengan penggunaan, ketidakmampuan menggunakan, atau akibat dari penggunaan situs kami, setiap situs web yang terkait dengannya dan setiap materi yang diiklankan.&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;Hal ini tidak berpengaruh pada kewajiban kami yang tidak dapat dikecualikan atau dibatasi berdasarkan hukum yang berlaku.&lt;/p&gt;\n\n&lt;p&gt;Materi yang ditayangkan di situs kami adalah untuk informasi saja guna membantu anda memutuskan untuk mengajukan penawaran atau tidak mengajukan penawaran dibidang properti. Kami atau salah satu karyawan kami tidak bertanggung jawab atas akibat langsung atau tidak langsung dari keputusan anda untuk mengajukan penawaran atau tidak mengajukan penawaran.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;I. HUKUM DAN WILAYAH HUKUM&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\n&lt;br /&gt;\nSyarat dan Ketentuan ini berlaku sesuai dengan hukum Negara Indonesia.&amp;nbsp; Dimana terjadi perselisihan maka akan dicoba untuk diselesaikan secara musyawarah dan kekeluargaan untuk mencapai mufakat.&amp;nbsp; Namun bila tidak tercapai kesepakatan, perselisihan akan diselesaikan secara hukum di pengadilan Indonesia.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;J. LAIN-LAIN&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;\n&lt;br /&gt;\nPada saat anda menggunakan jasa layanan kami, maka anda dianggap telah membaca, memahami dan menyetujui dengan seluruh klausul dari syarat dan ketentuan yang berlaku.&lt;br /&gt;\n&lt;br /&gt;\nSyarat dan Ketentuan, Kebijakan Privasi, dan notis-notis lainnya mengandung seluruh perjanjian antara anda dan CV. Ashar Pratama sehubungan dengan penggunaan website rumahta.com.&lt;br /&gt;\n&lt;br /&gt;\nBila dari ketentuan ini ada yang bertentangan dengan hukum yang berlaku, maka ketentuan tersebut menjadi tidak berlaku, akan tetapi ketentuan lainnya masih akan tetap berlaku.&lt;br /&gt;\n&lt;br /&gt;\nKami menyarankan anda secara berkala untuk meninjau kembali dan memahami setiap perubahan yang terjadi pada Syarat dan Ketentuan dari rumahta.com.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;*&lt;em&gt;Jika anda setuju dengan Aturan dan Ketentuan diatas silakan lanjutkan untuk menjadi member kami, terima kasih&lt;/em&gt;.&amp;nbsp; :)&lt;/p&gt;\n\n&lt;p style=&quot;text-align: center;&quot;&gt;=======oo0oo=======&lt;/p&gt;'),
(7, 'FAQ (Frequently Asked Question)', 'FAQ (Frequently Asked Question)', '&lt;p&gt;&lt;br /&gt;\n&lt;em&gt;&lt;strong&gt;Beberapa pertanyaan yang sering dilontarkan oleh pengguna jasa kami :&lt;/strong&gt;&lt;/em&gt;&lt;br /&gt;\n&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;1. Apakah Rumahta.com adalah agen properti?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;Rumahta.com &lt;strong&gt;bukanlah&lt;/strong&gt; merupakan agen atau perantara properti. Rumahta.com adalah media jasa periklanan properti untuk membantu Developer, Agen iklan dan Perorangan mengiklankan / mempromosikan propertinya melalui jaringan Internet secara profesional.&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;2. Apa keuntungan memasang iklan properti Anda di Rumahta.com? &lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;Bagi Penjual :&lt;/strong&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;em&gt;Iklan anda dapat diakses dari seluruh Indonesia terutama pencari properti di Sulawesi Selatan.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Rumahta.com tidak memungut biaya apapun jika terjadi pembelian properti yang terpasang di rumahta.com.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Menghemat waktu, dapat dipasang kapan saja dan diedit secara langsung.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Jika &amp;nbsp;anda memasang foto properti maka calon pembeli dapat melihat kondisi fisik properti tersebut sebelum melakukan kunjungan, sehingga calon pembeli memiliki sedikit gambaran tentang properti yang diminati. Dibandingkan dengan beriklan di koran anda bisa memasang foto/gambar dan punya banyak tempat untuk memperinci kelebihan properti anda.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Dapat menghapus dan melakukan koreksi iklan anda secara langsung melalui rumahta.com dengan melakukan Log In terlebih dahulu.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Anda dapat memasang iklan listing gratis atau memilih jumlah paket iklan listing premium (Berbayar) anda yaitu Paket 1 iklan listing, Paket 15 iklan listing, Paket 50 iklan listing, Paket 75 iklan listing, Paket 100 iklan listing dan Paket 250 iklan listing dengan masing-masing iklan listing berdurasi 12 bulan.&lt;/em&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&lt;strong&gt;Bagi Calon Pembeli/penyewa :&lt;/strong&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;em&gt;calon pembeli/penyewa juga dapat mengakses kapan dan dimanapun dengan mudah melalui &lt;strong&gt;PC&lt;/strong&gt;, &lt;strong&gt;Laptop&lt;/strong&gt;, &lt;strong&gt;Handphone&lt;/strong&gt;, &lt;strong&gt;Smartphone&lt;/strong&gt; dan &lt;strong&gt;Tablet&lt;/strong&gt;.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Rumahta.com tidak memungut biaya apapun jika anda pada akhirnya membeli properti yang terpasang di situs kami. Tujuan dari rumahta.com adalah sebagai media penengah antara penjual dan pembeli properti.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Setiap iklan properti dapat disertai dengan foto dari properti tersebut sehingga dapat memberikan gambaran tentang kondisi sesungguhnya dari properti tersebut dan sekitarnya. Dengan cara ini, pembeli dapat menghemat waktu untuk memilih dan melakukan kunjungan.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Calon pembeli dapat menghubungi dan bernegosiasi langsung dengan pemasang iklan melalui menghubungi pengiklan yang terdapat dilisting yang pembeli/penjual minati tersebut.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Rumahta.com memiliki fitur pencarian terfokus dimana fitur ini dapat membantu calon pembeli untuk mencari properti yang sesuai dengan keinginannya dengan cepat dan tepat.&lt;/em&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;3. Mengapa memasang iklan di Rumahta.com lebih murah dibanding iklan cetak atau website lainnya?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;Salah satunya adalah promosi properti di rumahta.com &lt;strong&gt;memungkinkan anda menjangkau target market yang tak terbatas&lt;/strong&gt; di seluruh dunia khususnya pencari properti di &lt;strong&gt;Sulawesi Selatan&lt;/strong&gt;. Sementara, jika iklan dipasang dimedia cetak&amp;nbsp; hanya memungkinkan anda memasarkan pada lingkup yang terbatas dan cenderung hanya menjangkau pasar lokal atau nasional. Itu pun diperlukan biaya yang tidak sedikit.&lt;/em&gt;&lt;br /&gt;\n&lt;br /&gt;\n&lt;em&gt;Efektifitas promosi dan pemasaran online telah teruji. Promosi online ini lebih efektif karena anda bisa membidik &lt;strong&gt;target market yang tepat dan dapat diakses dimana pun dan dapat langsung menghubungi pemilik properti.&lt;/strong&gt; Anda pun &lt;strong&gt;tidak harus membuang banyak waktu dan&lt;/strong&gt; &lt;strong&gt;biaya&lt;/strong&gt; untuk pasar yang bukan menjadi target anda.&lt;br /&gt;\n&lt;br /&gt;\nPada promosi online, &lt;strong&gt;modal dan resikonya lebih kecil &lt;/strong&gt;dibandingkan dengan modal dan resiko pasang iklan cetak&amp;nbsp; Bandingkan saja, secara sederhana kita ambil contoh koran nasional terbesar di Indonesia mengenakan tarif puluhan hingga ratusan juta rupiah untuk sekali tayang dalam sekali terbit. Jika menggunakan media online, banyak teknologi pemasaran yang bisa diterapkan untuk menekan biaya iklan.&lt;br /&gt;\n&lt;br /&gt;\nDibandingkan dengan website properti lainnya, memasang iklan di rumahta.com hanya dikenakan biaya &lt;strong&gt;Rp 50.000/12 bulan. &lt;/strong&gt;&lt;/em&gt;&lt;br /&gt;\n&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;4. Bagaimana cara memasang Iklan Listing? Adakah yang harus saya hubungi?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;Tidak perlu, anda cukup mengakses situs Rumahta.com dan mengikuti petunjuknya yang telah kami siapkan untuk mempermudah anda memasang iklan. Untuk melihat langkah-langkah untuk mendaftar menjadi member anda bisa melihat dihalaman &lt;a href=&quot;http://rumahta.com/page/page_detail/15/pasang-iklan&quot;&gt;&lt;strong&gt;Pasang Iklan&lt;/strong&gt;&lt;/a&gt;.&lt;/em&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;em&gt;Silahkan &lt;strong&gt;mendaftar&lt;/strong&gt; / &lt;strong&gt;sign up&lt;/strong&gt; &amp;nbsp;terlebih dahulu, isi informasi yang dibutuhkan perhatikan penulisan email anda yang benar, ingat baik-baik user name dan password anda.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;&lt;strong&gt;Login&lt;/strong&gt; ke account anda dengan user name dan password anda.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Anda akan berada di &lt;strong&gt;member area&lt;/strong&gt;.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Pasang iklan anda dengan klik menu &lt;strong&gt;Listing&lt;/strong&gt;.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Klik &lt;strong&gt;Pasang Iklan&lt;/strong&gt;.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Klik &lt;strong&gt;Kategori&lt;/strong&gt; pilih properti yang anda jual atau sewakan.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Dan isi &lt;strong&gt;Data Properti&lt;/strong&gt; dengan jelas dan lengkap.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Selengkapnya cara atau panduan memasang iklan terdapat pada menu &amp;#39;BANTUAN&amp;#39; di MEMBER AREA.&lt;/em&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;5. Mengapa harus mendaftar terlebih dahulu?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;Anda harus mendaftar terlebih dahulu untuk membuat MEMBER AREA Anda sekaligus data kontak dan data login Anda. Dimana pada MEMBER AREA nanti, Anda dapat membuat iklan, mengubah data, membuat URL, mengedit .dan menghapus iklan anda yang sudah terjual/tersewa.&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;6. Bagaimana cara memasang Iklan Banner?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;em&gt;Silahkan &lt;strong&gt;mendaftar&lt;/strong&gt; / &lt;strong&gt;sign up&lt;/strong&gt; &amp;nbsp;terlebih dahulu, isi informasi yang dibutuhkan perhatikan penulisan email anda yang benar, ingat baik-baik user name dan password anda.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;&lt;strong&gt;Login&lt;/strong&gt; ke account anda dengan user name dan password anda.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Anda akan berada di &lt;strong&gt;member area&lt;/strong&gt;.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Pasang iklan anda dengan klik menu &lt;strong&gt;Banner&lt;/strong&gt;.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Klik &lt;strong&gt;Pesan Banner&lt;/strong&gt;.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Klik &lt;strong&gt;Posisi Banner&lt;/strong&gt; pilih durasi tayang banner anda.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Dan isi &lt;strong&gt;Link Banner&lt;/strong&gt;.&lt;/em&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;7. Berapa lama masa tayang iklan?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;Masa tayang semua iklan listing adalah &lt;strong&gt;12 Bulan &lt;/strong&gt;perlistingnya.&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;8. Saya lupa password atau user name saya?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;em&gt;Anda dapat membuka kembali email saat anda mendaftar sebagai member, atau...&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;&lt;strong&gt;Lupa Password&lt;/strong&gt; di kanan atas dan masukkan alamat email anda, password akan dikirimkan ke email tersebut.&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Jika anda lupa user name klik &lt;strong&gt;Forgot you user name&lt;/strong&gt; di Login Form dan masukkan alamat email Anda, user name akan dikirimkan ke email tersebut.&lt;/em&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;9. Bagaimana cara mengubah iklan?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;em&gt;Login ke account anda dengan user name dan password anda&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Anda akan berada di &lt;strong&gt;Member Area&lt;/strong&gt;&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Klik &lt;strong&gt;Menu Listing &amp;gt; Pengaturan listing&lt;/strong&gt;&lt;/em&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;10. Bagaimana cara menghapus iklan atau sudah jika terjual/tersewa?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;em&gt;Login ke account anda dengan user name dan password anda&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Anda akan berada di &lt;strong&gt;Member Area&lt;/strong&gt;&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Klik &lt;strong&gt;Menu Listing &amp;gt; Pengaturan listing&lt;/strong&gt;&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Klik pada &lt;strong&gt;delete &lt;/strong&gt;pada iklan yang ingin dihapus&lt;/em&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;11. Apakah saya mendapatkan halaman profile untuk mencantumkan alamat / email / telp / foto?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;Ya, dan profile anda dapat diupdate dengan cara:&lt;/em&gt;&lt;/p&gt;\n\n&lt;ul&gt;\n &lt;li&gt;&lt;em&gt;Login ke account anda dengan user name dan password anda&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;Anda akan berada di &lt;strong&gt;Member Area&lt;/strong&gt;&lt;/em&gt;&lt;/li&gt;\n &lt;li&gt;&lt;em&gt;&lt;strong&gt;&lt;em&gt;Pasang &amp;nbsp;ataupun update profile detil &amp;amp; foto Anda &amp;nbsp;dengan klik menu &lt;strong&gt;profile &amp;gt; edit profil&lt;/strong&gt;.&lt;/em&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/li&gt;\n&lt;/ul&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;12. Bagaimana cara kerja rumahta.com ?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;Rumahta.com adalah media iklan online tugas utama kami adalah menghubungkan penjual/penyewa dengan pembeli/penyewa, dimana kami melakukan sosialisasi terus menerus untuk memperkenalkan rumahta.com sebagai media informasi properti khususnya untuk Sulawesi Selatan.&lt;/p&gt;\n\n&lt;p&gt;Intinya Anda yang menitip properti Anda dan biarkan kami yang mempromosikannya...&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;'),
(15, 'Cara Pasang Iklan', 'Cara Pasang Iklan', '&lt;h2&gt;&lt;img alt=&quot;&quot; height=&quot;69&quot; src=&quot;/asset/kcfinder/upload/images/2679918.png&quot; width=&quot;347&quot; /&gt;&lt;/h2&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;CARA PASANG IKLAN MUDAH DAN EFEKTIF&lt;/span&gt;&lt;br /&gt;\n&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(255, 0, 0);&quot;&gt;Tidak serumit mencari user kesana kemari.&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;em&gt;&lt;strong&gt;Lima langkah cara gampang pasang iklan listing dan banner di rumahta.com :&lt;/strong&gt;&lt;/em&gt;&lt;/span&gt;&lt;br /&gt;\n&lt;br /&gt;\n&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;color:#009900;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;LANGKAH PERTAMA&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Silakan &lt;strong&gt;JADI MEMBER &lt;/strong&gt;&lt;/span&gt;&lt;span style=&quot;color:#FF0000;&quot;&gt;&lt;strong&gt;&lt;em&gt;GRATIS!!!&lt;/em&gt;&lt;/strong&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt; terlebuh dahulu dengan klik &lt;/span&gt;&lt;strong&gt;&lt;span style=&quot;color: rgb(0, 0, 255);&quot;&gt;&amp;ldquo;&lt;/span&gt;&lt;a href=&quot;http://rumahta.com/home/signup&quot; target=&quot;_blank&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 255);&quot;&gt;Daftar Sekarang&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;color: rgb(0, 0, 255);&quot;&gt;&amp;rdquo;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;color: rgb(0, 0, 255);&quot;&gt; &lt;/span&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;anda hanya sekali registrasi untuk pemasangan semua iklan anda.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Mengapa harus mendaftar? Agar anda dapat mengedit data kontak dan iklan anda &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;sesuai yang diinginkan&lt;/span&gt; &lt;span style=&quot;font-size:14px;&quot;&gt;(Daftar dan pasang iklan tidak serumit mencari user kesana kemari, hanya sekali daftar dan&amp;nbsp; &lt;em&gt;gratis !&lt;/em&gt;)&lt;/span&gt;.&lt;/p&gt;\n\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;&quot; height=&quot;154&quot; src=&quot;/asset/kcfinder/upload/images/daftar.png&quot; width=&quot;516&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 153, 0);&quot;&gt;&lt;strong&gt;LANGKAH KEDUA&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Isi formulir &lt;strong&gt;&amp;ldquo;Pendaftaran Member&amp;rdquo;&lt;/strong&gt; dengan benar lalu klik tombol &lt;em&gt;&lt;strong&gt;&amp;ldquo;Daftar Sekarang&amp;rdquo;&lt;/strong&gt;&lt;/em&gt;.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;&quot; height=&quot;876&quot; src=&quot;/asset/kcfinder/upload/images/Formulir_Pendaftaran.png&quot; width=&quot;524&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 153, 0);&quot;&gt;&lt;strong&gt;LANGKAH KETIGA&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Cek email anda lalu buka email dari kami &lt;em&gt;&lt;strong&gt;&amp;ldquo;Verifikasi Pendafataran Rumahta.com&amp;rdquo;&lt;/strong&gt;&lt;/em&gt; lalu klik &lt;strong&gt;&lt;em&gt;&amp;ldquo;Link Verifikasi&amp;rdquo;&lt;/em&gt;&lt;/strong&gt; untuk mengaktifkan keanggotaan anda.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;&quot; height=&quot;258&quot; src=&quot;/asset/kcfinder/upload/images/Email.JPG&quot; width=&quot;534&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 153, 0);&quot;&gt;&lt;strong&gt;LANGKAH KEEMPAT&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Lalu silakan login dan masukkan &lt;strong&gt;USERNAME&lt;/strong&gt; dan &lt;strong&gt;PASSWORD&lt;/strong&gt; yang telah anda buat untuk masuk ke halaman &lt;strong&gt;Member Area&lt;/strong&gt;.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;img alt=&quot;&quot; height=&quot;110&quot; src=&quot;/asset/kcfinder/upload/images/Formulir_Pendaftaran1.png&quot; width=&quot;544&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 153, 0);&quot;&gt;&lt;strong&gt;LANGKAH KELIMA&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n&lt;br /&gt;\n&lt;span style=&quot;font-family:arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;Setelah masuk ke &lt;strong&gt;Member Area&lt;/strong&gt; anda, untuk pemasangan Iklan Listing atau Banner silakan ke menu &lt;strong&gt;&amp;ldquo;Listing atau Banner&amp;rdquo;&lt;/strong&gt;, lebih jelasnya anda bisa lihat atau buka menu &lt;strong&gt;&amp;ldquo;Bantuan&amp;rdquo;&lt;/strong&gt;.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/p&gt;\n\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 0, 0);&quot;&gt;&lt;img alt=&quot;&quot; height=&quot;327&quot; src=&quot;/asset/kcfinder/upload/images/Member_Area(1).png&quot; width=&quot;649&quot; /&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Jika ada yang kurang jelas jangan segan-segan untuk hubungi kami di :&lt;br /&gt;\n0411-5771447 atau 081355386147&lt;/span&gt;&lt;/p&gt;\n\n&lt;p style=&quot;text-align: center;&quot;&gt;&amp;nbsp;&lt;/p&gt;'),
(17, 'Peraturan dan Ketentuan Listing', 'Peraturan dan Ketentuan Pemasangan Listing', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan wajib membaca dan menyetujui poin-poin yang diuraikan dalam &lt;strong&gt;Peraturan dan Ketentuan&lt;/strong&gt; sebagai berikut :&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Admin rumahta.com&amp;nbsp;dapat merevisi, menambah atau mengurangi Aturan dan kondisi yang telah ditetapkan. Hasil revisi &amp;lsquo;Peraturan dan Ketentuan&amp;rsquo; yang diberlakukan menggantikan &amp;lsquo;Peraturan dan Ketentuan&amp;rsquo; sebelumnya, dan silakan meninjau halaman ini setiap saat.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk tidak menggunakan kata-kata maupun penulisan yang sifatnya menyerang, mencemarkan individu maupun kelompok tertentu, kasar, kotor atau yang melanggar etika berinternet.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan dilarang menjiplak, menutupi, memalsukan, atau memanipulasi isi atau materi iklan serta tindakan yang mengarah kepada penipuan yang berakibat merugikan para pihak.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan dilarang untuk membuat identitas palsu, menutup-nutupi atau memanipulasi identitas yang berakibat merugikan para pihak.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk tidak memasang iklan secara berulangkali baik di dalam kategori yang sama maupun dalam beberapa kategori lainnya.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk tidak mengupload atau memasang iklan yang bernuansa SARA dan mengandung unsur-unsur pornografi baik dalam bentuk tulisan maupun gambar.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk tidak memasang iklan yang melanggar hak cipta yang terdaftar secara hukum, paten, merek dagang maupun hak cipta inteletual dari pihak lain.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk tidak memasang iklan yang menjual atau mencari barang atau jasa yang&amp;nbsp; dilarang diperjualbelikan berdasarkan peraturan hukum yang berlaku atau yang dilarang diperjualbelikan secara bebas di Indonesia, termasuk tapi tidak terbatas pada senjata dan amunisi, barang-barang bajakan, barang-barabg selundupan, identitas dan dokumen&amp;nbsp; palsu, obata-obatan terlarang , narkotika, prostitusi, pornografi, binatang atau bagian-bagian tubuh binatang yang dilindung, organ/bagian tubuh&amp;nbsp; manusia.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan dilarang memasang iklan berbau pornografi, perjudian, menghasut/menyerang pihak lain, dan penipuan serta semua hal yang bertentangan dengan hukum yang berlaku.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk memasang iklan sesuai kategori, untuk iklan premium hanya untuk&amp;nbsp;iklan properti dan iklan Banner hanya yang berhubungan dengan properti.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Untuk iklan yang masa tayangnya telah Expired (kadaluarsa) lebih dari 12 (Dua Belas) akan otomatis terhapus dari Database (untuk Iklan Gratis, Iklan Premium, dan Iklan Banner).&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Untuk pemasang Iklan Gratis dan Iklan Premium yang properti nya sudah terjual harap menghapus iklan anda.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Admi rumahta.com tidak bertanggung jawab atas semua iklan yang termuat dalam Web ini, isi iklan menjadi tanggungjawab pemasang Iklan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Hak Cipta rumahta.com dilindungi Undang-Undang yang berlaku. Dilarang keras meng-copy, menyadur, mengutip sebagian atau seluruh isi yang terdapat didalam rumahta.com ke dalam bentuk apapun dan untuk kepentingan apapun tanpa ijin tertulis dari admin dari rumahta.com.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Rumahta.com menampilkan data pribadi seperti e-mail, alamat, dan nomor kontak anda pada Listing Properti untuk diperlihatkan kepada calon pembeli/penyewa properti anda.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pelanggaran terhadap aturan ini akan dikenakan sangsi berupa Peringatan dan Penghapusan Keanggotaan anda.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Menerima untuk tidak dapat melakukan login pada versi mobile.&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp; Selamat beriklan...semoga sukses..&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp; Salam Sukses&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp; Rumahta.com &amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;');
INSERT INTO `tbl_page` (`id_page`, `title`, `nama`, `content`) VALUES
(16, 'Bantuan', 'Bantuan', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;Menu member area&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;Menu untuk Member Area pada &amp;quot;&lt;strong&gt;Lingkaran Merah&lt;/strong&gt;&amp;quot;.&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;img alt=&quot;&quot; height=&quot;305&quot; src=&quot;/asset/kcfinder/upload/images/Member_Area.png&quot; width=&quot;603&quot; /&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;Bagaimana cara saya mengubah profil dan foto profil saya?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Silakan klik menu &lt;strong&gt;&lt;em&gt;Listing&lt;/em&gt; &lt;/strong&gt;lalu klik &lt;strong&gt;&lt;em&gt;Edit Profil&lt;/em&gt;&lt;/strong&gt;&lt;em&gt;, &lt;/em&gt;&lt;/span&gt;Untuk memasang foto profil dan ingin menyesuikan tampilannya, anda harus menyiapkan foto dengan ukuran maksimal 150x150 pixel.&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Apa guna URL Member pada menu Listing?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Yang dimaksud URL atau Uniform Resource Locator adalah Dimana kita harus mengetikkan URL yang kita tuju agar kita bisa mengakses sumber atau iklan &amp;nbsp;yang kita ingin lihat. Jadi jika Anda mengisi form URL. Misal : Anda mengisi dengan &lt;strong&gt;&lt;em&gt;&amp;lsquo;&lt;span style=&quot;color:#0000FF;&quot;&gt;nama_anda&lt;/span&gt;&amp;rsquo;&lt;/em&gt;&lt;/strong&gt; (Tanpa spasi) maka bila mengetikkan dibrowser dengan &lt;strong&gt;&lt;em&gt;&amp;lsquo;http://rumahta.com/&lt;span style=&quot;color:#0000FF;&quot;&gt;nama_anda&lt;/span&gt;&amp;rsquo; &lt;/em&gt;&lt;/strong&gt;maka yang tertampil hanya &lt;strong&gt;Iklan Listing Properti&lt;/strong&gt; Anda.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Agar calon pembeli Anda lebih mudah menemukan iklan properti Anda, maka silakan Anda mempromosikan URL singkat Anda tersebut pada &lt;em&gt;Kartu Nama, Brosur, Poster, Stiker, dll&lt;/em&gt;.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;Bagaimana cara memasang Iklan Properti saya?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Silakan klik menu &lt;strong&gt;&lt;em&gt;Listing &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;Pasang Iklan&lt;/strong&gt;.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;Apa perbedaan Iklan Listing Gratis dengan Iklan Premium (Berbayar)?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Iklan Listing terbagi dua yaitu &lt;strong&gt;&amp;ldquo;Gratis&amp;rdquo;&lt;/strong&gt; dan &lt;strong&gt;&amp;ldquo;Premium&amp;rdquo;&lt;/strong&gt; perbedaannya yaitu &amp;ldquo;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;strong&gt;Iklan Listing Gratis&lt;/strong&gt;, posisi iklan listingnya berada dibawah seluruh iklan listing premium,&amp;nbsp; dapat memposting hingga 100 iklan listing gratis dan disetiap postingan hanya dapat memasang maksimal 3 foto bagian-bagian properti Anda.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;Iklan Listing Premium&lt;/strong&gt; (Berbayar), selalu berada diatas iklan listing gratis. Listing iklan premium lebih menonjol dengan &lt;em&gt;&lt;u&gt;warna lebih mencolok&lt;/u&gt;&lt;/em&gt; dan meningkatkan kesempatan untuk lebih banyak yang melihat iklan Anda, selain itu iklan Anda tampil terus menerus setiap hari selama 12 bulan. Setiap postingan Anda dapat memasang&amp;nbsp; hingga 7 foto bagian-bagian properti anda, setiap member dapat memesan beberapa paket listing yang bisa Anda pilih.&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Bagaimana cara saya memasang Iklan Listing Gratis?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Silakan klik menu &lt;strong&gt;&lt;em&gt;Listing &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;&lt;em&gt;Pasang Iklan&lt;/em&gt;&lt;/strong&gt;, pilih dan klik tombol &amp;lsquo;Pasang Listing/Iklan&amp;rsquo; yang sejajar dengan &amp;lsquo;Listing Gratis&amp;rsquo;.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Untuk pemasangan Iklan Listing Gratis silakan langsung klik tombol &lt;strong&gt;&amp;lsquo;biru&amp;rsquo;&lt;/strong&gt;, lalu isi dengan lengkap lengkap informasi properti Anda.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Perhatikan baik-baik dalam pemilihan &lt;strong&gt;&lt;em&gt;&amp;lsquo;Kategori&amp;rsquo;&lt;/em&gt;&lt;/strong&gt; properti yang ingin Anda iklankan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Isi informasi lain properti Anda termasuk 3 foto bagian-bagian properti yang dapat menarik pembeli/penyewa dengan ukuran 500 x 500 pixel.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Setelah semua informasi iklan Anda telah terisi silakan klik tombol &lt;strong&gt;&lt;em&gt;&amp;lsquo;Pasang Listing&amp;rsquo;&lt;/em&gt; &lt;/strong&gt;untuk menampilkan iklan Anda.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Dikarenakan upload foto hanya untuk 1(Satu) foto pada formulir pasang iklan maka foto yang 2 (Dua)nya lagi bisa Anda tambahkan pada menu &lt;strong&gt;&amp;#39;Listing&amp;#39;&lt;/strong&gt; lalu pilih &lt;strong&gt;&amp;#39;Pengaturan Listing&amp;#39;&lt;/strong&gt;, pastikan ukuran foto listing anda berukuran 500 x 500 Pixel.&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Bagaimana cara saya &amp;nbsp;memiliki Iklan Listing Premium (Berbayar)?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Karena Iklan Listing tersebut berbayar maka Anda terlebih dahulu harus memilih &amp;#39;&lt;strong&gt;Paket&lt;/strong&gt;&amp;#39; sesuai jumlah listing iklan yang Anda ingin pasang.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Sebelum Anda memilih paket sebaiknya membaca &lt;strong&gt;&lt;em&gt;&amp;lsquo;Peraturan dan Ketentuan&amp;rsquo;&lt;/em&gt;&lt;/strong&gt; pada menu &lt;strong&gt;&lt;em&gt;&amp;lsquo;Listing&amp;rsquo; &lt;/em&gt;&lt;/strong&gt;terlebih dahulu.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Caranya :&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Silakan klik menu &lt;strong&gt;&lt;em&gt;Listing &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;&lt;em&gt;Daftar/Upgrade Paket &lt;/em&gt;&lt;/strong&gt;lalu pilih paket yang diinginkan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Lalu muncul &amp;lsquo;Konfirmasi&amp;rsquo; jika menginginkan paket tersebut silakan klik &lt;strong&gt;&lt;em&gt;&amp;lsquo;Upgrade/Beli Paket&amp;rsquo;&lt;/em&gt;&lt;/strong&gt;, dan jika batal silakan klik &lt;strong&gt;&lt;em&gt;&amp;lsquo;Cancel&amp;rsquo;&lt;/em&gt;&lt;/strong&gt;.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Jika sudah klik &lt;strong&gt;&lt;em&gt;&amp;lsquo;Upgrade/Beli Paket&amp;rsquo;&lt;/em&gt;&lt;/strong&gt;, silakan cek email Anda untuk melihat Invoice pemesanan paket Anda.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Setelah melakukan pembayaran silakan klik menu &lt;strong&gt;&lt;em&gt;Listing &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;&lt;em&gt;Konfirmasi Pembayaran&lt;/em&gt;&lt;/strong&gt;.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Setelah kami cek konfirmasi pembayaran Anda, kami segera &lt;strong&gt;&lt;em&gt;aktifkan&lt;/em&gt;&lt;/strong&gt; paket &lt;strong&gt;&lt;em&gt;&amp;lsquo;Iklan Premium&amp;rsquo;&lt;/em&gt;&lt;/strong&gt; dan infonya dikirim ke email Anda.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Untuk cara memasang &amp;#39;Iklan Listing Premium&amp;#39; Anda silakan lihat dibawah ini.&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Bagaimana cara saya memasang Iklan Premium (Berbayar)?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Jika Paket Iklan Premium Anda sudah diaktifkan :&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Silakan klik menu &lt;strong&gt;&lt;em&gt;Listing &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;&lt;em&gt;Pasang Iklan &lt;/em&gt;&lt;/strong&gt;jika tombol paket Iklan Premium pilihan Anda berwarna &lt;strong&gt;&lt;em&gt;&amp;lsquo;Biru&amp;rsquo; &lt;/em&gt;&lt;/strong&gt;berarti paket Anda sudah diaktifkan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Untuk pemasangan Iklan Listing Premium silakan langsung klik tombol &lt;strong&gt;&amp;lsquo;biru&amp;rsquo;&lt;/strong&gt;, lalu isi dengan lengkap lengkap informasi properti Anda.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Perhatikan baik-baik dalam pemilihan &lt;strong&gt;&lt;em&gt;&amp;lsquo;Kategori&amp;rsquo;&lt;/em&gt;&lt;/strong&gt; properti yang ingin Anda iklankan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Isi informasi lain properti Anda termasuk 7 foto bagian-bagian properti yang dapat menarik pembeli/penyewa.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Setelah semua informasi iklan Anda telah terisi silakan klik tombol &lt;strong&gt;&lt;em&gt;&amp;lsquo;Pasang Listing&amp;rsquo;&lt;/em&gt; &lt;/strong&gt;untuk menampilkan iklan Anda.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Dikarenakan upload foto hanya untuk 1(Satu) foto pada formulir pasang iklan maka foto yang 6 (Enam)nya lagi bisa Anda tambahkan dihalaman &lt;strong&gt;&amp;#39;Pengaturan Listing&amp;#39;&lt;/strong&gt;, pastikan ukuran foto listing anda berukuran 500 x 500 Pixel.&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;Bagaimana cara saya &amp;nbsp;membuat judul iklan listing yang baik?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Untuk membuat judul listing efektif dibagian judul ikutkan nama kawasan properti Anda misal &amp;quot; Rumah sederhana di BTP atau Mamminasata, bisa juga anda melihat trik membuat judul yang baik dengan &lt;strong&gt;&lt;a href=&quot;http://rumahta.com/page/news_detail/22/Trik-membuat-judul-iklan-properti-yang-efektif-di-Rumahta.com&quot; target=&quot;_blank&quot;&gt;klik disini&lt;/a&gt;&lt;/strong&gt; untuk langsung ke trik tersebut.&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;Bagaimana cara menambah foto iklan listing saya?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Anda dapat mengupload foto yang lainnya melalui menu &lt;strong&gt;&amp;ldquo;Pengaturan Listing&amp;rdquo;&lt;/strong&gt;, klik &lt;strong&gt;&lt;em&gt;Tanda Pensil&lt;/em&gt;&lt;/strong&gt; pada kolom &lt;strong&gt;aksi&lt;/strong&gt;, lalu klik &lt;strong&gt;&amp;ldquo;Tambah Gambar Listing&amp;rdquo;&lt;/strong&gt; (Bagian bawah), &lt;/span&gt;pastikan ukuran foto listing anda berukuran 500 x 500 Pixel&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;/asset/kcfinder/upload/images/tambah_foto.png&quot; style=&quot;width: 645px; height: 195px;&quot; /&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;strong&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;Kenapa upload saya lama dan tidak berhasil?&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Kemungkinan disebabkan ukuran foto yang Anda upload ukurannya terlalu besar, dimana seharusnya&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:14px;&quot;&gt; foto listing anda berukuran 500 x 500 Pixel&lt;/span&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;. Cara merubah ukuran foto menjadi &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;berukuran 500 x 500 Pixel&lt;/span&gt; &lt;span style=&quot;font-size:14px;&quot;&gt;silakan lihat dibawah ini.&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;strong&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;Bagaimana cara agar ukuran foto iklan listing saya berukuran 500 x 500 pixel?&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;em&gt;Pilih gambar atau foto yang akan dirubah ukurannya. Sebaiknya Anda menduplikat foto tersebut sebelum dirubah ukurannya. Caranya klik kanan foto yang akan dirubah lalu pilih edit.&lt;/em&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/asset/kcfinder/upload/images/edit-image.png&quot; style=&quot;width: 283px; height: 320px;&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;em&gt;Secara default foto tersebut akan terbuka pada program Paint. Jika tidak terbuka di Paint, Klik kanan gambar atau foto lalu klik &amp;#39;&lt;strong&gt;Open with&lt;/strong&gt;&amp;#39; lalu pilih &amp;#39;&lt;strong&gt;Paint&lt;/strong&gt;&amp;#39;.&lt;/em&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;em&gt;Selanjutnya pada program Paint, klik &amp;#39;&lt;strong&gt;Resize&lt;/strong&gt;&amp;#39; lalu pada jendela &amp;#39;&lt;strong&gt;Resize and Skew&lt;/strong&gt;&amp;#39; pilih &amp;#39;&lt;strong&gt;Pixels&lt;/strong&gt; lalu beri tanda chek pada &amp;#39;&lt;strong&gt;Maintain aspec ratio&lt;/strong&gt;&amp;#39;.&lt;/em&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;em&gt;Ukuran normal &lt;strong&gt;horisontal 500 pixels&lt;/strong&gt; dan &lt;strong&gt;verticalnya dibiarkan saja&lt;/strong&gt;.&lt;/em&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/asset/kcfinder/upload/images/resize-image.png&quot; style=&quot;width: 302px; height: 320px;&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Klik &lt;strong&gt;OK&lt;/strong&gt; lalu simpan (Save as).&lt;/span&gt;&lt;/span&gt;&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;br /&gt;\n&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Bagaimana mengganti foto depan/utama iklan Listing saya?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Silakan klik&lt;/span&gt; &lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;menu &lt;strong&gt;&amp;ldquo;Pengaturan Listing&amp;rdquo;&lt;/strong&gt;, klik &lt;strong&gt;&lt;em&gt;Tanda Pensil&lt;/em&gt;&lt;/strong&gt; pada kolom &lt;strong&gt;aksi&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt; &lt;span style=&quot;font-size:14px;&quot;&gt;lalu klik tanda &amp;#39;&lt;strong&gt;label&lt;/strong&gt;&amp;#39; yang ada pada foto yang ingin dijadikan foto depan/utama, letaknya diatas kanan pada masing-masing foto sebelah tanda silang.&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;/asset/kcfinder/upload/images/ganti_foto_utama.png&quot; style=&quot;width: 645px; height: 195px;&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Kenapa pada bagian isian &lt;em&gt;&amp;lsquo;Alamat&amp;rsquo; &lt;/em&gt;tidak dapat diedit?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Cara tersebut salah satu sistem kami untuk menghindari pemasangan Iklan Properti yang berbeda setelah properti mereka terjual/tersewa, jadi diharapkan pengisian alamat properti yang Anda iklankan diisi dengan teliti, jika ingin perbaikan alamat dengan iklan yang sama silakan email ke admin &amp;#39;Alamat yang akan diperbaikan dan jangan lupa cantumkan Username dan Nama Anda&amp;#39; ke admin@rumahta.com.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 128, 0);&quot;&gt;&lt;strong&gt;Bagaimana cara saya mengubah atau mengatur iklan saya?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Untuk pengaturan Iklan Listing Anda, silakan klik menu &lt;strong&gt;&lt;em&gt;Listing &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;&lt;em&gt;Pengaturan Listing&lt;/em&gt;&lt;/strong&gt;, lalu klik &lt;strong&gt;&lt;em&gt;Tanda Pensil&lt;/em&gt;&lt;/strong&gt; pada kolom &lt;strong&gt;aksi&lt;/strong&gt;.&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Untuk pengaturan Iklan Banner Anda, silakan klik menu &lt;strong&gt;&lt;em&gt;Banner &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;&lt;em&gt;Paket iklan&lt;/em&gt;&lt;/strong&gt;.&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#008000;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Bagaimana cara bila iklan properti saya sudah terjual atau tersewa?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Silakan klik menu &lt;strong&gt;&lt;em&gt;Listing &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;&lt;em&gt;Pengaturan Listing&lt;/em&gt;&lt;/strong&gt;, lalu klik &lt;strong&gt;&lt;em&gt;&amp;#39;Belum&amp;#39; &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;Ok&lt;/strong&gt;.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;br /&gt;\n&lt;span style=&quot;color:#008000;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Bagaimana cara bila iklan properti saya, yang sudah terjual atau tersewa ingin ditampilkan kembali?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Silakan klik menu &lt;strong&gt;&lt;em&gt;Listing &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;&lt;em&gt;Pengaturan Listing&lt;/em&gt;&lt;/strong&gt;, lalu klik &lt;strong&gt;&lt;em&gt;&amp;#39;Terjual/Tersewa&amp;#39; &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;Ok&lt;/strong&gt; .&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Saya ingin memasang Iklan Banner bagaimana caranya?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Sebelum Anda memasang banner sebaiknya membaca &lt;strong&gt;&lt;em&gt;&amp;lsquo;Peraturan dan Ketentuan&amp;rsquo;&lt;/em&gt;&lt;/strong&gt; pada menu &lt;strong&gt;&lt;em&gt;&amp;lsquo;Banner&amp;rsquo; &lt;/em&gt;&lt;/strong&gt;terlebih dahulu.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Silakan klik menu &lt;strong&gt;&lt;em&gt;Listing &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;&lt;em&gt;Pesan Banner &lt;/em&gt;&lt;/strong&gt;lalu pilih &lt;strong&gt;&lt;em&gt;&amp;lsquo;Posisi banner&amp;rsquo;&lt;/em&gt;&lt;/strong&gt; yang diinginkan, tapi sebelumnya lihat sisa slot terlebih dahulu.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Jika masih ada slot silakan pilih dengan klik tombol &lt;strong&gt;&lt;em&gt;&amp;lsquo;Pesan Iklan Banner&amp;rsquo;&lt;/em&gt;&lt;/strong&gt;.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Lalu muncul formulir pemasangna banner, silakan pilih durasi yang diinginkan (3 Bulan, 6 Bulan dan 12 Bulan), alamat link dan banner yang akan ditampilkan (Sesuai ukuran yang sudah ditentukan) &amp;nbsp;jika sudah silakan klik tombol &lt;strong&gt;&lt;em&gt;&amp;lsquo;Pesan Banner&amp;rsquo;&lt;/em&gt;&lt;/strong&gt; atau jika batal silakan klik &lt;strong&gt;&lt;em&gt;&amp;lsquo;Cancel&amp;rsquo;&lt;/em&gt;&lt;/strong&gt;.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Jika sudah klik &lt;strong&gt;&lt;em&gt;&amp;lsquo;Pesan Banner&amp;rsquo;&lt;/em&gt;&lt;/strong&gt;, silakan cek email Anda untuk melihat Invoice pemesanan banner Anda.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Setelah melakukan pembayaran silakan klik menu &lt;strong&gt;&lt;em&gt;Banner &lt;/em&gt;&lt;/strong&gt;lalu klik &lt;strong&gt;&lt;em&gt;Konfirmasi Pembayaran&lt;/em&gt;&lt;/strong&gt;.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Setelah kami cek konfirmasi pembayaran Anda, kami segera &lt;strong&gt;&lt;em&gt;publish banner&amp;nbsp;&lt;/em&gt;&lt;/strong&gt;Anda.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Apa itu menu &lt;em&gt;&amp;lsquo;Testimonial&amp;rsquo;&lt;/em&gt;?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Testimonial adalah bagaimana pengalaman &amp;amp; pendapat Anda tentang rumahta.com, besar harapan kami bila Anda bersedia memberikan pendapat dan masukan positif anda tentang keberadaan media iklan properti online rumahta.com khusus untuk informasi properti di Sulawesi Selatan.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Saya ingin mengubah atau menghapus iklan properti saya, bagaimana jika &amp;nbsp;saya tidak menemukan iklan saya tersebut?&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Silakan ke menu &lt;strong&gt;&lt;em&gt;&amp;lsquo;Pencarian&amp;rsquo; &lt;/em&gt;&lt;/strong&gt;lalu masukkan ciri informasi iklan properti Anda.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;Apakah saya dapat pasang iklan selain menggunakan PC atau Laptop?&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Bisa, dengan melalui Smartphone atau Tablet yang menggunakan resolusi display 1000 keatas, jika resolusi displaynya dibawah &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;1000 tampilannya akan otomatis mengarah ke versi mobile dimana versi mobile tersebut tidak mempunyai fasilitas login. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;color: rgb(0, 100, 0);&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Mengapa pada versi mobile tidak dapat digunakan untuk login dan tidak ada tampilan iklan banner?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Terkecuali tampilan Versi mobile ini tidak dapat digunakan untuk login ke Member Area karena hanya dikhususkan untuk diakses oleh para pembeli/penyewa properti Anda, dan iklan banner sengaja tidak ditampilkan pada versi mobile untuk menghindari lambatnya proses loading saat mengakses iklan Anda.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Saya ingin keluar dari Member Area caranya bagaimana?&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Silakan klik tombol &lt;strong&gt;&lt;em&gt;&amp;lsquo;Logout&amp;rsquo;&lt;/em&gt;&lt;/strong&gt; &amp;nbsp;sudut kanan atas website.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#006400;&quot;&gt;&lt;span style=&quot;font-size: 16px;&quot;&gt;Jika ada yang saya tidak mengerti apa yang saya lakukan?&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Jangan segan-segan untuk menghubungi kami melalui email admin@rumahta.com atau Telepon ke 0411-5771447 / 081355386147.&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;'),
(18, 'Peraturan dan Ketentuan Banner', 'Peraturan dan Ketentuan Banner', '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan wajib membaca dan menyetujui poin-poin yang diuraikan dalam &lt;strong&gt;Peraturan dan Ketentuan&lt;/strong&gt; sebagai berikut :&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;ol&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Admin rumahta.com&amp;nbsp;dapat merevisi, menambah atau mengurangi Aturan dan kondisi yang telah ditetapkan. Hasil revisi &amp;lsquo;Peraturan dan Ketentuan&amp;rsquo; yang diberlakukan menggantikan &amp;lsquo;Peraturan dan Ketentuan&amp;rsquo; sebelumnya, dan silakan meninjau halaman ini setiap saat.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk tidak menggunakan kata-kata maupun penulisan yang sifatnya menyerang, mencemarkan individu maupun kelompok tertentu, kasar, kotor atau yang melanggar etika berinternet.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan dilarang menjiplak, menutupi, memalsukan, atau memanipulasi isi atau materi iklan serta tindakan yang mengarah kepada penipuan yang berakibat merugikan para pihak.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan dilarang untuk membuat identitas palsu, menutup-nutupi atau memanipulasi identitas yang berakibat merugikan para pihak.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk tidak memasang iklan secara berulangkali baik di dalam kategori yang sama maupun dalam beberapa kategori lainnya.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk tidak mengupload atau memasang iklan yang bernuansa SARA dan mengandung unsur-unsur pornografi baik dalam bentuk tulisan maupun gambar.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk tidak memasang iklan yang melanggar hak cipta yang terdaftar secara hukum, paten, merek dagang maupun hak cipta inteletual dari pihak lain.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk tidak memasang iklan yang menjual atau mencari barang atau jasa yang&amp;nbsp; dilarang diperjualbelikan berdasarkan peraturan hukum yang berlaku atau yang dilarang diperjualbelikan secara bebas di Indonesia, termasuk tapi tidak terbatas pada senjata dan amunisi, barang-barang bajakan, barang-barabg selundupan, identitas dan dokumen&amp;nbsp; palsu, obata-obatan terlarang , narkotika, prostitusi, pornografi, binatang atau bagian-bagian tubuh binatang yang dilindung, organ/bagian tubuh&amp;nbsp; manusia.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan dilarang memasang iklan berbau pornografi, perjudian, menghasut/menyerang pihak lain, dan penipuan serta semua hal yang bertentangan dengan hukum yang berlaku.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pemasang iklan setuju untuk memasang iklan sesuai kategori, untuk iklan premium hanya untuk&amp;nbsp;iklan properti dan iklan Banner hanya yang berhubungan dengan properti.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Untuk iklan yang masa tayangnya telah Expired (kadaluarsa) lebih dari 12 (Dua Belas) akan otomatis terhapus dari Database (untuk Iklan Gratis, Iklan Premium, dan Iklan Banner).&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Untuk pemasang Iklan Gratis dan Iklan Premium yang properti nya sudah terjual harap menghapus iklan Anda.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Admin rumahta.com tidak bertanggung jawab atas semua iklan yang termuat dalam Web ini, isi iklan menjadi tanggungjawab pemasang Iklan.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Hak Cipta rumahta.com dilindungi Undang-Undang yang berlaku. Dilarang keras meng-copy, menyadur, mengutip sebagian atau seluruh isi yang terdapat didalam rumahta.com ke dalam bentuk apapun dan untuk kepentingan apapun tanpa ijin tertulis dari admin dari rumahta.com.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Rumahta.com menampilkan data pribadi seperti e-mail, alamat, dan nomor kontak Anda pada Listing Properti untuk diperlihatkan kepada calon pembeli/penyewa properti Anda.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;Pelanggaran terhadap aturan ini akan dikenakan sangsi berupa Peringatan dan Penghapusan Keanggotaan Anda.&lt;/span&gt;&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Menerima bila Iklan banner yang Anda pasang tidak ditampilkan pada versi mobile.&lt;/span&gt;&lt;br /&gt;\n &amp;nbsp;&lt;/li&gt;\n &lt;li&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Menerima untuk tidak dapat melakukan login pada versi mobile.&lt;/span&gt;&lt;/li&gt;\n&lt;/ol&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp; Selamat beriklan...semoga sukses..&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp; Salam Sukses&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family: arial,helvetica,sans-serif;&quot;&gt;&amp;nbsp; &amp;nbsp;&amp;nbsp; Rumahta.com &amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;');
